"url\";s:42:\"https://wordpress.org/plugins/hello-dolly/\";s:7:\"package\";s:58:\"https://downloads.wordpress.org/plugin/hello-dolly.1.6.zip\";}s:45:\"ozh-admin-drop-down-menu/wp_ozh_adminmenu.php\";O:8:\"stdClass\":6:{s:2:\"id\";s:4:\"1057\";s:4:\"slug\";s:24:\"ozh-admin-drop-down-menu\";s:6:\"plugin\";s:45:\"ozh-admin-drop-down-menu/wp_ozh_adminmenu.php\";s:11:\"new_version\";s:6:\"3.6.10\";s:3:\"url\";s:55:\"https://wordpress.org/plugins/ozh-admin-drop-down-menu/\";s:7:\"package\";s:67:\"https://downloads.wordpress.org/plugin/ozh-admin-drop-down-menu.zip\";}}}','yes'),(2506,'_transient_timeout_feed_d117b5738fbd35bd8c0391cda1f2b5d9','1462567631','no'),(2507,'_transient_feed_d117b5738fbd35bd8c0391cda1f2b5d9','a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n\n\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:61:\"\n	\n	\n	\n	\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"WordPress Planet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"language\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"en\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress Planet - http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"item\";a:50:{i:0;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: WordPress 4.6 to Drop Open Sans in the Admin in Favor of System Fonts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54507\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"http://wptavern.com/wordpress-4-6-to-drop-open-sans-in-the-admin-in-favor-of-system-fonts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2130:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/05/system-fonts-firefox-osx.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/05/system-fonts-firefox-osx.png?resize=1025%2C450\" alt=\"system-fonts-firefox-osx\" class=\"aligncenter size-full wp-image-54575\" /></a></p>\n<p>WordPress 4.6 will bid farewell to Open Sans in the admin in favor of using system fonts. Open Sans, which loads from Google Fonts as an external resource, has been in use in the admin since 2013.</p>\n<p>&#8220;At the time of introduction in 3.8, there were not good system fonts common to all platforms at the time,&#8221; WordPress lead developer <a href=\"http://helenhousandi.com/\" target=\"_blank\">Helen Hou-Sandí</a> said in her <a href=\"https://core.trac.wordpress.org/changeset/37361\" target=\"_blank\">commit</a> message. &#8220;In the years since, Windows, Android, OS X, iOS, Firefox OS, and various flavors of Linux have all gotten their own (good) system UI fonts.&#8221;</p>\n<p>Now that the admin doesn&#8217;t have to load fonts from Google, it should feel faster and will provide a better experience for developers who are working offline.</p>\n<p>Dropping Open Sans originated as part of the <a href=\"https://make.wordpress.org/core/features/font-natively/\" target=\"_blank\">Font Natively</a> feature project led by WordPress designer <a href=\"https://mattmiklic.com/\" target=\"_blank\">Matt Miklic</a>, Mark Uraine, and Helen Hou-Sandí. The project page provides screenshots for the WP admin with Open Sans in Firefox on OSX vs the admin with system fonts, but the team noted that they are in need of more screenshots from different environments.</p>\n<p>Anytime that WordPress can shed a third-party dependency while improving the experience in the admin is a win for everyone. The commit comes early in the release cycle in order to get more people testing for misalignments and any other issues. Feel free to report any bugs you experience with the change, as work is still ongoing on the <a href=\"https://core.trac.wordpress.org/ticket/36753\" target=\"_blank\">ticket</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 May 2016 20:50:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: Ninja Forms Update Patches Critical Security Vulnerability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54556\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"http://wptavern.com/ninja-forms-update-patches-critical-security-vulnerability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4325:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/03/NinjaFormsFeaturedImage.png\"><img class=\"aligncenter size-full wp-image-40019\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/03/NinjaFormsFeaturedImage.png?resize=840%2C273\" alt=\"Ninja Forms Featured Image\" /></a><a href=\"https://wordpress.org/plugins/ninja-forms/\">Ninja Forms</a>, a popular plugin active on more than 500K websites, released an update 48 hours ago that addresses a critical security vulnerability. Wordfence <a href=\"https://www.wordfence.com/blog/2016/05/ninja-forms-shell-upload-vulnerability-high-risk/\">is reporting</a> that Ninja Forms versions 2.9.36 to 2.9.42 contain multiple security vulnerabilities.</p>\n<p>One of the vulnerabilities allows an attacker to upload and execute code remotely on WordPress sites. The only information needed to exploit the vulnerability is the URL of the target site that&#8217;s using a form powered by an affected version of Ninja Forms.</p>\n<p>Kevin Stover, CTO of Ninja Forms, explains to the Tavern how they discovered the vulnerabilities:</p>\n<blockquote><p>About two weeks ago, we were contacted by a security researcher, James Golovich, regarding a file upload issue within Ninja Forms. He demonstrated that it was possible to upload an arbitrary file using some test code that hadn’t been removed during our build process.</p>\n<p>We realised that the test code had accidentally been utilised in other areas of the plugin, and we immediately began working on a fix. While the issue was being patched, we reached out to the devs at the <a href=\"http://wordpress.org/\" target=\"_blank\" rel=\"noreferrer\">WordPress.org</a> repo and began the processes of preparing for auto updating users of the affected versions.</p>\n<p>Once the patch had been tested, we pushed version 2.9.43 and .1 versions of 2.9.36 &#8211; 2.9.42. Shortly after, <a href=\"http://wordpress.org/\" target=\"_blank\" rel=\"noreferrer\">WordPress.org</a> began pushing out automatic updates.</p></blockquote>\n<p>As to why there wasn&#8217;t a post published immediately on the official <a href=\"https://ninjaforms.com/blog/\">Ninja Forms blog</a> announcing the update, &#8220;We didn’t want to go public with the vulnerability until our users had time to update, both to the newest version and the .1 versions,&#8221; Stover said.</p>\n<p>&#8220;James Golovich&#8217;s responsible disclosure gave us time to fix the issue and for our users to update to safe versions before disclosing the vulnerability on his site,&#8221; he said. The company has since <a href=\"https://ninjaforms.com/important-security-update-always-hurt-ones-love/\">published a blog post </a>concerning the update.</p>\n<p>Working with the WordPress security team, automatic updates started rolling out on Tuesday, May 3rd. If automatic plugin updates are disabled, you&#8217;re highly encouraged to update manually to 2.9.45 as soon as possible. The Ninja Forms team is also working with a number of large webhosts to ensure as many sites as possible are updated.</p>\n<p>Wordfence is not detecting wide-spread exploitation but this could change in the next few days as details of the exploit emerge.</p>\n<p>When it comes to security vulnerabilities, the ability to upload and execute code remotely is about as severe as it gets. Golovich is credited with <a href=\"http://www.pritect.net/blog/ninja-forms-2-9-42-critical-security-vulnerabilities\">responsibly disclosing</a> the vulnerability to the Ninja Forms team. He also provides technical details of each vulnerability, most of which are in the Ninja Forms 3.0 code base.</p>\n<p>According to Golovich, the most vulnerable code is a proof of concept:</p>\n<blockquote><p>The following vulnerable code was, according to Kyle Johnson of the WP Ninjas team &#8216;not a live feature of Ninja Forms, but was more of a proof of concept for a future free feature.&#8217; Unfortunately, even proof of concept code that is accessible is still vulnerable to attack. This is the most critical vulnerability here because it potentially allows an attacker to execute arbitrary php code on a site.</p></blockquote>\n<p>Users should update as soon as possible as it&#8217;s only a matter of time before tools are created that can easily take advantage of the exploit.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 May 2016 20:46:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: WordPress.org Support Forums Adds Accessibility Section\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54472\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"http://wptavern.com/wordpress-org-support-forums-adds-accessibility-section\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3619:\"<p>Earlier this year, the WordPress project made a huge move by <a href=\"http://wptavern.com/wordpress-adopts-accessibility-coding-standards-for-all-new-and-updated-code\">adopting accessibility coding standards</a> for new and updated code. If you&#8217;re struggling to meet <a href=\"https://www.w3.org/WAI/intro/wcag\">WCAG 2.0 guidelines</a> in your WordPress projects and need help, check out the new <a href=\"https://wordpress.org/support/forum/accessibility\">Accessibility section</a> in the WordPress.org support forums.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/WPAccessibilitySupport.png\"><img class=\"size-full wp-image-54551\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/WPAccessibilitySupport.png?resize=1025%2C487\" alt=\"WordPress Accessibility Support\" /></a>WordPress Accessibility Support\n<p>Amanda Rush, who helps WordPress developers make their themes and plugins accessible, says the forum is the result of a conversation with a support team member at WordCamp Atlanta.</p>\n<p>&#8220;I <span class=\"message_body\">mentioned that part of what makes the job difficult when it comes to making WordPress accessible is stopping during our work to answer occasional questions.<br />\n</span></p>\n<p>&#8220;Most of the time the answer is not a quick one, because in the case of screen reader users, you have to first find out how well they can use their tech, how familiar they are with WordPress itself, and if neither of those chances are high, you spend time giving them a crash course in either one or both, and then answer their question,&#8221; <span class=\"message_body\">Rush said. </span></p>\n<p>Most of the people on the <a href=\"https://make.wordpress.org/accessibility/\">WordPress Accessibility team</a> are volunteers with full-time jobs which limits their ability to provide one-on-one support. Many of the support queries come through email or direct messages to individuals on the team. The forum enables everyone to participate in the support process.</p>\n<p>&#8220;If people ask their questions publicly, I or others not necessarily on the Accessibility Team can answer, and the answers are then public,&#8221; Rush said.</p>\n<p>&#8220;We have a pattern library on GitHub, which we all contribute to when we have time. But there are all kinds of solutions being passed around on Twitter and spread across other people&#8217;s GitHub accounts. So if someone asks a question like that, we can either point to something in specific cases, which is most of them, there&#8217;s probably already a specific solution that someone&#8217;s built, and we can link to that,&#8221; Rush told the Tavern.</p>\n<p>The accessibility support forum also comes with a side benefit, &#8220;W<span class=\"message_body\">e don&#8217;t have to say no all the time when people ask for support, or what looks like all the time to some people. Everyone can help each other </span><span class=\"message_body\">out and Google has a public resource,&#8221; Rush said.<br />\n</span></p>\n<p>The support forum comes at a time where accessibility is an increasingly important part of web development. For example, the European Union <a href=\"http://europa.eu/rapid/press-release_IP-16-1654_en.htm\">recently agreed to new rules</a> that will make public sector websites and apps more accessible.</p>\n<p>If you have any questions related to accessibility, you can post them on the forum. If you have experience and knowledge in the accessibility field, consider answering questions as it&#8217;s a great way to contribute to the WordPress project.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 May 2016 20:13:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:110:\"WPTavern: Font Awesome CDN Now in Beta, Loads Icons Asynchronously with Automatic Accessibility Best Practices\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54509\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:119:\"http://wptavern.com/font-awesome-cdn-now-in-beta-loads-icons-asynchronously-with-automatic-accessibility-best-practices\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2903:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/05/font-awesome.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/05/font-awesome.png?resize=1025%2C326\" alt=\"font-awesome\" class=\"aligncenter size-full wp-image-54532\" /></a></p>\n<p><a href=\"https://fortawesome.github.io/Font-Awesome/\" target=\"_blank\">Font Awesome</a>, the open source vector icon collection used by more than 300 plugins on WordPress.org and many free and commercial themes, <a href=\"https://articles.fortawesome.com/announcing-font-awesome-cdn-81773e0b301f#.egol888o7\" target=\"_blank\">announced the beta release of its new CDN</a>. Developers can now add a single line of code to bring the icons and CSS toolkit into their projects.</p>\n<p>The icon files and CSS are hosted by <a href=\"https://www.maxcdn.com/\" target=\"_blank\">MaxCDN</a>, which serves a cached version that loads quickly on websites that use Font Awesome. The CDN uses <a href=\"https://github.com/typekit/webfontloader\" target=\"_blank\">Web Font Loader</a>, which was co-developed by Google and Typekit, to load the icons asynchronously. This also gives developers <a href=\"https://github.com/typekit/webfontloader#events\" target=\"_blank\">CSS and JavaScript events</a> to hook into on loading.</p>\n<p><a href=\"http://wptavern.com/font-awesome-4-6-0-adds-new-accessibility-icons-category\" target=\"_blank\">FontAwesome 4.6 added a new accessibility icon category</a> and the new CDN helps to automate outputting the correct markup. If the icon you&#8217;re using has semantic meaning, including an accurate title attribute with the inline icon will trigger Font Awesome&#8217;s JS to do the rest.</p>\n<p>Font Awesome requires an email address from those want to use the CDN so it can issue a unique embed code for each. Developers also have the option to register a Font Awesome CDN account to keep track of sites and apps where they are using the icons, and manage multiple embed codes. Once logged in, you can enable or disable auto-accessibility, asynchronous icon loading, easy updates to newer Font Awesome versions, and CSS or JS embed.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/05/font-awesome-account.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/05/font-awesome-account.png?resize=1025%2C865\" alt=\"font-awesome-account\" class=\"aligncenter size-full wp-image-54543\" /></a></p>\n<p>One of the most convenient reasons to use the CDN is to simplify updates. WordPress plugin and theme developers do not have to bump versions or push any code to use the latest version. Font Awesome version changes can be triggered on an individual basis for each embed code in a developer&#8217;s account dashboard. Check out the instructions at <a href=\"https://cdn.fontawesome.com/\" target=\"_blank\">cdn.fontawesome.com</a> to get your project hooked up.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 May 2016 18:09:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WP Mobile Apps: WordPress for Android: Version 5.3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.com/?p=3352\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://apps.wordpress.com/2016/05/05/wordpress-for-android-version-5-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3203:\"<p>Hello WordPress users! <a href=\"https://play.google.com/store/apps/details?id=org.wordpress.android\" target=\"_blank\">Version 5.3 of the WordPress for Android app</a> is now available in the Google Play Store.</p>\n<h1>Account Settings and App Settings</h1>\n<p>We split the old Account Settings into two distinct screens: Account Settings for everything related to your account, and App Settings for everything specific to the App, like the interface language, PIN lock, and Analytics opt-out.</p>\n<p><img class=\"alignnone size-full wp-image-3354\" src=\"https://apps.files.wordpress.com/2016/04/screenshot-2016-04-04_15-43-50-172.png?w=640\" alt=\"screenshot-2016-04-04_15.43.50.172\" /></p>\n<h1>Delete WordPress.com site</h1>\n<p>With 4.3, you can now export your content (posts, pages, and settings) by email and delete your WordPress.com site from the app.</p>\n<p><img class=\"alignnone size-full wp-image-3356\" src=\"https://apps.files.wordpress.com/2016/04/screenshot-2016-04-04_15-45-34-504.png?w=640\" alt=\"screenshot-2016-04-04_15.45.34.504\" /></p>\n<h1>Other Changes</h1>\n<p>Version 5.3 also comes with a few other enhancements:</p>\n<ul>\n<li>New styling of the action bar in the Reader.</li>\n<li>If you made changes to a post, you&#8217;ll see a confirmation blink on <strong>Blog Posts</strong> when returning to the <strong>My site</strong> screen.</li>\n<li>Better styling of the Post and Page Preview screen.</li>\n<li>An updated support tool reduces crashes.</li>\n</ul>\n\n<a href=\"https://apps.wordpress.com/2016/05/05/wordpress-for-android-version-5-3/screenshot-2016-04-04_15-59-35-639/\"><img width=\"84\" height=\"150\" src=\"https://apps.files.wordpress.com/2016/04/screenshot-2016-04-04_15-59-35-639.png?w=84&h=150\" class=\"attachment-thumbnail size-thumbnail\" alt=\"screenshot-2016-04-04_15.59.35.639\" /></a>\n<a href=\"https://apps.wordpress.com/2016/05/05/wordpress-for-android-version-5-3/screenshot-2016-04-04_16-01-41-971/\"><img width=\"84\" height=\"150\" src=\"https://apps.files.wordpress.com/2016/04/screenshot-2016-04-04_16-01-41-971.png?w=84&h=150\" class=\"attachment-thumbnail size-thumbnail\" alt=\"screenshot-2016-04-04_16.01.41.971\" /></a>\n\n<p>We&#8217;re working hard on new features for the next version &#8212; you can track our development progress for the next release by visiting <a href=\"https://github.com/wordpress-mobile/WordPress-Android/milestones/5.4\">our 5.4 milestone on GitHub</a>.</p>\n<h1>Thank you</h1>\n<p>Thanks to our contributors: <a href=\"https://github.com/aforcier\">@aforcier</a>, <a href=\"https://github.com/daniloercoli\">@daniloercoli</a>, <a href=\"https://github.com/hypest\">@hypest</a>, <a href=\"https://github.com/kwonye\">@kwonye</a>, <a href=\"https://github.com/maxme\">@maxme</a>, <a href=\"https://github.com/mzorz\">@mzorz</a>, <a href=\"https://github.com/nbradbury\">@nbradbury</a>, <a href=\"https://github.com/oguzkocer\">@oguzkocer</a>, <a href=\"https://github.com/rishabh7m\">@rishabh7m</a>, <a href=\"https://github.com/roundhill\">@roundhill</a>, and <a href=\"https://github.com/tonyr59h\">@tonyr59h</a>.</p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3352&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 May 2016 08:57:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Maxime\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: WPWeekly Episode 233 – Recap of WordCamp Chicago 2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=54518&preview_id=54518\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"http://wptavern.com/wpweekly-episode-233-recap-of-wordcamp-chicago-2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2903:\"<p>On this episode of WordPress Weekly, I describe my experience attending WordCamp Chicago 2016 this past weekend. Marcus Couch and I then discuss the news of the week including a new tool that helps WordCamp organizers create customized name badges.</p>\n<p>We also have a lengthy discussion on the freemium business model and how it&#8217;s affecting users of themes and plugins downloaded from the official directories. Last but not least, we talk about WooCommerce Connect, a new SaaS tool from Automattic that has a tight relationship with Jetpack.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/wordcamp-organizers-get-new-tool-for-creating-personalized-wordcamp-badges\">WordCamp Organizers Get New Tool for Creating Personalized WordCamp Badges</a><br />\n<a href=\"http://wptavern.com/wordpress-is-now-100-translated-into-marathi\">WordPress is Now 100% Translated Into Marathi</a><br />\n<a href=\"http://wptavern.com/templatic-hacked-files-and-databases-compromised\">Templatic Hacked, Files and Databases Compromised</a><br />\n<a href=\"http://wptavern.com/wordpress-theme-review-team-votes-on-new-guidelines-to-ban-obtrusive-upselling\">WordPress Theme Review Team Votes on New Guidelines to Ban Obtrusive Upselling</a><br />\n<a href=\"http://wptavern.com/automattic-introduces-woocommerce-connect-hosted-components-for-e-commerce\">Automattic Introduces WooCommerce Connect, Hosted Components for E-Commerce</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/rss-feed-canceller/\">RSS Feed Canceller </a>provides more control over your RSS feed. You can turn it on or off per post and control whether or not a post is excluded from the feed.</p>\n<p><a href=\"https://wordpress.org/plugins/tld-woocommerce-downloadable-product-update-emails/\">TLD WooCommerce Downloadable Product Update Emails</a> is a simple plugin that notifies customers who purchased a downloadable product via email that there&#8217;s an update available.</p>\n<p><a href=\"https://wordpress.org/plugins/inline-click-to-tweet/\">Inline Click To Tweet</a> allows authors to highlight text from within the visual editor and make it tweetable by clicking within the post or page.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, May 11th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #233:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 May 2016 08:46:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"WPTavern: WordCamp Chicago 2016 Was a Deep Dish of Fun\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54453\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"http://wptavern.com/wordcamp-chicago-2016-was-a-deep-dish-of-fun\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5547:\"<p><a href=\"https://2016.chicago.wordcamp.org/\">WordCamp Chicago 2016</a> was held at University Center in the heart of Chicago, IL, where more than 300 attendees spent the weekend learning about WordPress. The event was organized by Ryan Erwin and a <a href=\"https://2016.chicago.wordcamp.org/organizers/\">team of volunteers. </a></p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/05/JJJWCChicago2016.jpg\"><img class=\"size-full wp-image-54500\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/05/JJJWCChicago2016.jpg?resize=1024%2C768\" alt=\"John James Jacoby talking about bbPress and BuddyPress\" /></a>John James Jacoby talking about bbPress and BuddyPress\n<p>Tracks were split up into three separate rooms limiting the amount of background noise during sessions. Giving attendees a schedule is handled differently at most camps. Some provide a paper schedule while others put it on the back of the name badge.</p>\n<p>At WordCamp Chicago, schedule boards were displayed outside each room that corresponded with a track number. This made it easier for attendees to determine if they wanted to stay in the room for the next session.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/WCChicago2016Schedule.jpg\"><img class=\"size-full wp-image-54501\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/WCChicago2016Schedule.jpg?resize=1024%2C1365\" alt=\"Schedule Board Outside The Room Hosting Track 1\" /></a>Schedule Board Outside The Room Hosting Track 1\n<p>WordCamps are a great way to stress test a venue&#8217;s network but the WiFi at WordCamp Chicago was flawless. I didn&#8217;t experience any issues and it remained fast throughout the event. I didn&#8217;t stick around for lunch as there are plenty of lunch options available within walking distance of the venue.</p>\n<h2>The After Party</h2>\n<p>Most WordCamps host an after party at a restaurant, bar, or other establishment away from the venue. WordCamp Chicago&#8217;s after party was held at the venue. It included, non-alcoholic and alcoholic drinks, food, and card games on each table. It was fun mingling and networking with people without having to compete with blaring music or a loud atmosphere.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/05/WCChicago2016AfterParty.jpg\"><img class=\"size-full wp-image-54503\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/05/WCChicago2016AfterParty.jpg?resize=1024%2C768\" alt=\"WordCamp Chicago 2016 After Party\" /></a>WordCamp Chicago 2016 After Party\n<p>Out of all the sessions I attended, my favorite is <a href=\"https://2016.chicago.wordcamp.org/session/disastrous-deals-to-profitable-projects-comparing-my-best-and-worst-client-experiences/\">by Kyle Maurer,</a> who shared experiences and advice from <a href=\"http://realbigmarketing.com/\">building client websites</a> over the years.</p>\n<p>One of the biggest pieces of advice he shared is to build direct relationships with clients. No one is going to fight your battles as much as you and third-parties are unlikely to stick their neck out. Managing direct relationships leads to trust, referrals, and being rehired to do additional work.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/05/KyleMaurerSlideWCChicago2016.jpg\"><img class=\"size-full wp-image-54504\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/05/KyleMaurerSlideWCChicago2016.jpg?resize=1024%2C768\" alt=\"A Slide from Kyle Maurer\'s Presentation\" /></a>A Slide from Kyle Maurer&#8217;s Presentation\n<p>His session contains a lot of great information and I highly encourage you to watch it when it&#8217;s published on WordPress.tv.</p>\n<h2>WordCamps Offer a Lot of Value For The Price</h2>\n<p>Throughout the event, I spoke to a number of people and noted the following. Many attendees said they received more value than expected paying $40 a ticket. Some have spent hundreds of dollars on conference tickets and didn&#8217;t enjoy themselves or come away with nearly as much information.</p>\n<p>I discovered a number of attendees are part of one or more WordPress meetup groups. According to Meetup.com, there are at least <a href=\"http://www.meetup.com/find/?allMeetups=false&keywords=Chicago+WordPress&radius=25&userFreeform=chicago+I&mcId=c60601&change=yes&sort=recommended&eventFilter=mysugg\">four WordPress groups </a>with hundreds of members spread throughout the Chicago area. It&#8217;s a strong indication that the WordPress community in Chicago is thriving and supportive of each other.</p>\n<h2>WordCamp Chicago in 2017</h2>\n<p>It was a pleasure attending WordCamp Chicago and making new friends. I especially enjoyed speaking to WordPress Weekly listeners and getting their feedback. Also for those wondering, I satisfied my craving for deep-dish pizza via <a href=\"http://www.loumalnatis.com/arizona-phoenix\">Lou Malnati&#8217;s</a>. The pizza tastes better than I remembered. If you&#8217;re ever in the Chicago area, you have to try Lou Malnati&#8217;s pizza.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/TheLou.jpg\"><img class=\"size-full wp-image-54505\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/TheLou.jpg?resize=1024%2C768\" alt=\"The Lou!\" /></a>The Lou!\n<p>Everyone involved with WordCamp Chicago 2016 did a great job. If you didn&#8217;t get a chance to attend this year, don&#8217;t worry. After taking a break for a few weeks, the organizing team plans to begin organizing WordCamp Chicago 2017.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 May 2016 03:00:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"WPTavern: Automattic Introduces WooCommerce Connect, Hosted Components for E-Commerce\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54476\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"http://wptavern.com/automattic-introduces-woocommerce-connect-hosted-components-for-e-commerce\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5426:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/woocommerce-logo.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/woocommerce-logo.png?resize=1025%2C466\" alt=\"woocommerce-logo\" class=\"aligncenter size-full wp-image-54492\" /></a></p>\n<p><a href=\"https://www.woothemes.com/woocommerce/\" target=\"_blank\">WooCommerce</a> is the current leader in e-commerce software, capturing <a href=\"https://wappalyzer.com/categories/ecommerce\" target=\"_blank\">31% of the market</a>, thanks to its relatively user-friendly interface and connection to WordPress. However, setting up a WooCommerce site, or any e-commerce site for that matter, is not for the faint of heart, no matter how user-friendly the software. It requires knowledge of hosting, PCI compliance, payment gateways, SSL certificates, shipping methods, tax, and more.</p>\n<p>When <a href=\"http://wptavern.com/automattic-acquires-woocommerce\" target=\"_blank\">Automattic acquired WooCommerce</a> last May, the company accepted the challenge to make it as easy to create stores online as WordPress.com has done for websites.</p>\n<p>“I believe that the web needs an open, independent and easy-to-use commerce platform that you can run yourself on your own website,” Matt Mullenweg said in his <a href=\"https://www.youtube.com/watch?v=xJOfTB8-daA\" target=\"_blank\">video</a> announcement of the acquisition.</p>\n<p>Automattic has been working to simplify selling with WooCommerce and today the company announced <a href=\"https://www.woothemes.com/2016/05/woocommerce-connect-announcement/\" target=\"_blank\">WooCommerce Connect</a>, the secret project that Mullenweg <a href=\"https://twitter.com/WooConf/status/717725650916741120\" target=\"_blank\">hinted</a> at during WooConf.</p>\n<p>WC Connect is WooCommerce&#8217;s new Automattic-hosted SaaS architecture that was created to offer store features in a more user-friendly way. It is built on the WP REST API and offers a simplified Calypso-style interface for configuring options.</p>\n<p>The first service offered via the alpha version of WC Connect is real-time USPS shipping rates for US-based stores. It eliminates the need for a USPS API key as well as a subscription key from WooCommerce. One of the advantages for the user is that there are fewer software updates to install for extensions, as all the code is maintained on Automattic&#8217;s servers.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/usps-wc-connect.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/usps-wc-connect.png?resize=650%2C362\" alt=\"usps-wc-connect\" class=\"aligncenter size-full wp-image-54493\" /></a></p>\n<h3>What&#8217;s Next for WooCommerce Connect?</h3>\n<p>If the testing goes well, WooCommerce plans to roll Connect into the plugin&#8217;s core to make it easier to serve more hosted e-commerce components. The team is also working on expanding shipping options for the beta.</p>\n<p>&#8220;In the near future we hope to integrate with further shipping services, most likely Canada Post next,&#8221; said WooThemes co-founder <a href=\"https://twitter.com/mark_forrester\" target=\"_blank\">Mark Forrester</a>. &#8220;Shipping and payment options seem the logical place for us to start.&#8221;</p>\n<p>Forrester confirmed that while the USPS shipping method is free, WooThemes is exploring monetizing other service offerings in the future. If WC Connect has a successful beta period, the team will consider using the same model for offering payment gateways in the future.</p>\n<p>&#8220;Setting up payments for your store should be simple and behind the scenes,&#8221; Forrester said. &#8220;We believe we can offer better options for our customers working closely with payment partners and using connected services.&#8221;</p>\n<p>Forrester said that the team hopes WC Connect can be baked into WooCommerce core soon, but they will make the decision based on user feedback from the alpha/beta period.</p>\n<p>Those who create WooCommerce extensions and depend on its ecosystem may be wondering whether the SaaS model will overtake the plugin entirely. Last May, during his WooCommerce Q&amp;A, Matt Mullenweg <a href=\"https://ma.tt/2015/05/woomattic/#comment-583541\" target=\"_blank\">confirmed</a> that Automattic is not moving towards a 100% SaaS model.</p>\n<p>&#8220;If or when we do SAAS, the plugin isn’t going away, it’ll continue as it has,&#8221; Mullenweg said.</p>\n<p>WooCommerce is not being rolled into Jetpack, as many suspected when Automattic acquired the product. However, WC Connect does require users to connect to WordPress.com via Jetpack.</p>\n<p>&#8220;We feel it makes sense to leverage the code/infrastructure of one of the most powerful WordPress connected services,&#8221; Forrester said.</p>\n<p>The team is aiming to make WC Connect a simpler way to connect services to online stores without users having to leave their WooCommerce dashboards. Many store owners would rather pay for hosted software they don&#8217;t have to update as opposed to self-hosted extensions that require regular maintenance.</p>\n<p>If the strategy of offering hosted e-commmerce components succeeds at making store management easier for non-developers, Automattic will be able to profit from offering compelling commercial WC Connect services, such as payment gateways, and expand WooCommerce&#8217;s global reach.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 04 May 2016 22:20:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WPTavern: New Super Emoji Plus+ Plugin Adds an Elegant Emoji Picker to WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54422\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"http://wptavern.com/new-super-emoji-plus-plugin-adds-an-elegant-emoji-picker-to-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3082:\"<p>Last week when Beyoncé released her new Lemonade album, <a href=\"http://www.wired.com/2016/04/beyonce-lemonade-lemon-emoji/\" target=\"_blank\">lemon and bee emoji usage spiked on Twitter</a>. According to Twitter&#8217;s stats, during the month of April there were more than 2 million tweets that included at least one lemon emoji, 62% of which happened since the album release. The bee emoji, representing the Beyhive of Beyoncé fans, also found its way into 1.8 million tweets during April.</p>\n<p>There&#8217;s no denying that emoji permeate our culture and communication on the web, especially the mobile web. When people are excited, when they are communicating from the heart, they often use emoji. According to a study performed by emotional marketing platform Emogi last year, <a href=\"http://www.adweek.com/socialtimes/report-92-of-online-consumers-use-emoji-infographic/627521\" target=\"_blank\">92% of people online use emoji</a> and 63% of them are frequent users.</p>\n<p>Last year WordPress 4.2 <a href=\"http://wptavern.com/wordpress-4-2-on-track-to-expand-core-support-for-emoji\" target=\"_blank\">expanded core support for emoji</a>, adding along with it the ability to natively handle Chinese, Japanese, and Korean characters. This improvement came not a moment too soon, but emoji are still not readily accessible when publishing with WordPress until you launch the emoji keyboard for your operating system. There&#8217;s something disjointed about having to launch a separate keyboard when you&#8217;re trying to compose your thoughts.</p>\n<p><a href=\"https://wordpress.org/plugins/super-emoji-plus/\" target=\"_blank\">Super Emoji Plus+</a> is a new plugin that makes emoji more accessible. It was created by <a href=\"https://profiles.wordpress.org/ericlewis/\" target=\"_blank\">Eric Andrew Lewis</a>, a WordPress core contributor and developer at The New York Times. The plugin adds an elegant emoji picker to the post edit screen. It can be launched from the toolbar or via autocomplete when you start typing an emoji name, such as &#8220;:lemon&#8221;.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/super-emoji-toolbar.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/super-emoji-toolbar.png?resize=1025%2C640\" alt=\"super-emoji-toolbar\" class=\"aligncenter size-full wp-image-54458\" /></a></p>\n<p>If you use emoji in your WordPress posts, Super Emoji Plus+ provides convenient access to the full list. There&#8217;s no easier way to add emoji if you&#8217;re working from a desktop, as most emoji keyboard experiences are inferior to the one presented in this plugin. Having it installed removes the need for cheat sheets and saves you from having to remember the correct key combinations to launch an emoji keyboard. Super Emoji Plus+ <a href=\"https://ericandrewlewis.com/2016/04/super-emoji-plus-is-now-in-beta/\" target=\"_blank\">went into beta last week</a> and is now <a href=\"https://wordpress.org/plugins/super-emoji-plus/\" target=\"_blank\">available on WordPress.org</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 04 May 2016 06:15:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"WPTavern: bbPress 2.5.9 Patches Cross-Site-Scripting Vulnerability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54439\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"http://wptavern.com/bbpress-2-5-9-patches-cross-site-scripting-vulnerability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:945:\"<p>John James Jacoby, lead developer of bbPress, has <a href=\"https://bbpress.org/blog/2016/05/bbpress-2-5-9/\">released bbPress 2.5.9</a> to patch a security vulnerability, &#8220;bbPress 2.5.8 and below are susceptible to a cross-site-scripting vulnerability that&#8217;s due to the way users are linked to their profiles when they are mentioned in topics and replies,&#8221; Jacoby said.</p>\n<p>Marc-Alexandre Montpas is credited for <a href=\"https://make.wordpress.org/core/handbook/testing/reporting-security-vulnerabilities/\">responsibly disclosing</a> the vulnerability to the WordPress security team. The patch has already been applied to bbPress 2.6, which is currently in development. Users are advised to update their bbPress installations as soon as possible. Users who encounter issues updating to 2.5.9 can report them to the <a href=\"https://bbpress.org/forums/\">bbPress support forums</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 03 May 2016 23:10:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"WPTavern: WordPress Theme Review Team Votes on New Guidelines to Ban Obtrusive Upselling\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54428\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"http://wptavern.com/wordpress-theme-review-team-votes-on-new-guidelines-to-ban-obtrusive-upselling\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4201:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/05/post-no-bills.jpg\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/05/post-no-bills.jpg?resize=1024%2C602\" alt=\"photo credit: Post no bills - (license)\" class=\"size-full wp-image-54450\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/24415314@N02/26151211080\">Post no bills</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc-sa/2.0/\">(license)</a>\n<p>One of the main items on the agenda for the Theme Review Team this week was to finalize what type of upselling is allowed in themes hosted on WordPress.org. With the requirement of using the customizer for options, theme authors have gotten creative with upsells and will sometimes include panels and sections that are inoperable unless the user purchases the commercial version.</p>\n<p>The team voted on a set of guidelines previously discussed. The counts shown below represent votes in favor of each individual guideline, and no members voted against any of them, according to the reckoning Justin Tadlock posted in the <a href=\"https://make.wordpress.org/themes/2016/05/03/may-3rd-meeting-notes/\" target=\"_blank\">meeting notes</a>:</p>\n<ul>\n<li>No global nags at top of admin pages. +12</li>\n<li>One top-level link in the customizer (other unobtrusive links in sections allowed). +8</li>\n<li>Allow one Appearance sub-page. +11</li>\n<li>No options or panels/sections behind a paywall. +11</li>\n</ul>\n<p>Overall, team members agreed that any upsell links should be unobtrusive and the new proposed guidelines favor keeping the customizer clean and the Appearance menu simple. Although the majority of Theme Review Team members are in favor of the items above, their inclusion in the handbook is not yet set in stone.</p>\n<p>&#8220;Note that we might change some of the wording for clarity if/when these become guidelines,&#8221; Tadlock said. &#8220;The admins will review these items for inclusion as guidelines and have further discussion if need be.&#8221;</p>\n<h3>Theme Review Team Considers Adding a Tag to Designate Themes with a Commercial Upgrade</h3>\n<p>Contributors are looking to add a new designation for freemium WordPress.org extensions that have commercial counterparts available elsewhere. In a recent Meta Team meeting, Matt Mullenweg <a href=\"https://wordpress.slack.com/archives/meta/p1461801845000324\" target=\"_blank\">proposed an agenda item</a> for consideration in the redesign of the Plugin Directory.</p>\n<p>&#8220;I would love for y&#8217;all to figure out a tagging system that will help people know better what&#8217;s behind the installation of a plugin,&#8221; Mullenweg said. &#8220;Does it connect to an external service? Is there a premium version? Is it useful without those things?</p>\n<p>&#8220;If we can figure out a way to classify those three as examples, it&#8217;ll cover a lot of business models people are attempting in the directory,&#8221; Mullenweg said, referring to the original examples of Akismet, VaultPress, and Jetpack that he mentioned previously.</p>\n<p>&#8220;This can be separate from the 3-tag limit,&#8221; he said. &#8220;It&#8217;s really a special tag, and honor system is fine to start for self-classification.&#8221;</p>\n<p>This hasn&#8217;t yet been implemented in the new Plugin Directory, but Konstantin Obenland has the item on his list for when the Meta Team moves forward with an <a href=\"https://make.wordpress.org/plugins/2016/02/25/re-thinking-tags-in-the-plugin-directory/\" target=\"_blank\">overhaul of the tagging system</a>.</p>\n<p>As a result of this discussion, the Theme Review Team is also considering adding a &#8220;pro&#8221; designation for themes that have a commercial version available. Tadlock said that the team will be following up on the plugin directory discussions and will look to implement improved tagging in line with what the Meta Team decides.</p>\n<p>The Theme Review Team ran out of time during this week&#8217;s meeting but will discuss the possibility of a &#8220;pro&#8221; tag next week. If you want to be part of this discussion, make sure to join the #themereview channel on WordPress&#8217; Slack.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 03 May 2016 21:58:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"WPTavern: WordCamp Incubator Program Receives 182 Applications, Narrows Candidates to 16 Communities\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54398\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"http://wptavern.com/wordcamp-incubator-program-receives-182-applications-narrows-candidates-to-16-communities\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3358:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/incubator.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/05/incubator.jpg?resize=1024%2C505\" alt=\"photo credit: Chilliwack Chicken Chick - (license)\" class=\"size-full wp-image-54415\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/15521309@N05/16688186434\">Chilliwack Chicken Chick</a> &#8211; <a href=\"https://creativecommons.org/licenses/by/2.0/\">(license)</a>\n<p>In February the WordPress Community team announced that it would be <a href=\"http://wptavern.com/wordpress-to-launch-experimental-wordcamp-incubator-program\" target=\"_blank\">launching an experimental WordCamp Incubator program</a>. After a short application window of less than two weeks, the team received 182 applications from cities all over the world. Andrea Middleton <a href=\"https://make.wordpress.org/community/2016/04/28/wordcamp-incubator-update/\" target=\"_blank\">reported</a> that the team has narrowed the submissions down to the following 16 communities:</p>\n<ul>\n<li>Denpasar, Indonesia</li>\n<li>Chandigarh, India</li>\n<li>Colombo, Sri Lanka</li>\n<li>Thessaloniki, Greece</li>\n<li>Harare, Zimbabwe</li>\n<li>Budapest, Hungary</li>\n<li>Kalamata, Greece</li>\n<li>Kampala, Uganda</li>\n<li>Kochi, India</li>\n<li>Lagos, Nigeria</li>\n<li>Medellin, Colombia</li>\n<li>Nagpur, India</li>\n<li>Nairobi, Kenya</li>\n<li>San Jose, Costa Rica</li>\n<li>Udaipur, India</li>\n<li>Ulyanovsk, Russia</li>\n</ul>\n<p>Some of these communities already have active local meetups and others have no organization whatsoever. Selection of the final cities will be based on the location&#8217;s potential to foster an emerging WordPress community.</p>\n<p>The original plan was to incubate three WordCamps in 2016, but due to staffing changes the new scaled back plan is to commit to two events and intensively mentor a third. Middleton explained that the difference between the two is in the amount of support the local team will receive from the designated community team deputy:</p>\n<blockquote><p>Incubating an event will involve the deputy both advising local volunteers — acting as a kind of project manager for the team — as well as doing some of the organizing work on the event, like a lead organizer usually does. Intensively-mentoring will be more project management and involve less actual organizing work on the part of the deputy.</p></blockquote>\n<p>Middleton said the team is speaking with the remaining applicants about their communities and assessing their abilities to organize a one-day, one-track WordCamp with the help of the community team. The small events will focus on getting the local community connected for future events.</p>\n<p>The WordCamp Incubator program is an intriguing concept that has so far received a great deal of interest from potential new organizers. Many locations in the remaining list of candidates are situated in regions that are not as easily accessible to existing WordPress communities. These are places that might not otherwise have an opportunity to host a WordCamp for years without a little boost.</p>\n<p>We&#8217;ll be following the progress of the Incubator program to see if the experiment can successfully hatch a handful of new local communities. The three locations selected will be announced this month.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 03 May 2016 16:15:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: BuddyExtender: A Plugin for Configuring Internal BuddyPress Settings\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54342\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/buddyextender-a-plugin-for-configuring-internal-buddypress-settings\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2297:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/controls.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/controls.jpg?resize=960%2C443\" alt=\"photo credit: 	Drew Patrick Miller\" class=\"size-full wp-image-52988\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/2724C9A9DE\">	Drew Patrick Miller</a>\n<p>The BuddyPress codex has a long list of <a href=\"https://codex.buddypress.org/getting-started/customizing/changing-internal-configuration-settings/\" target=\"_blank\">internal configuration settings</a> that are not exposed in the plugin&#8217;s admin settings page. These are short definition lines that can be added to a site&#8217;s <em><a href=\"https://codex.buddypress.org/themes/bp-custom-php/\" target=\"_blank\">bp-custom.php file</a></em> to make changes to BuddyPress default settings.</p>\n<p><a href=\"https://wordpress.org/plugins/buddyextender/\" target=\"_blank\">BuddyExtender</a> is a new plugin from the development team at <a href=\"https://webdevstudios.com/\" target=\"_blank\">WebDevStudios</a> that aims to make it easier for community managers to access extra configuration options. The plugin puts a dozen internal BuddyPress settings at your fingertips, including avatar sizes, autocomplete settings, the ability to disable @mentions, and more.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/buddy-extender.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/buddy-extender.png?resize=678%2C1141\" alt=\"buddy-extender\" class=\"aligncenter size-full wp-image-54389\" /></a></p>\n<p>Once installed, the plugin can be configured at Settings -> BuddyExtender in the admin. Each setting has an explanation on <a href=\"https://pluginize.com/buddyextender-plugin/\" target=\"_blank\">the plugin&#8217;s homepage on Pluginize</a>, WebDevStudio&#8217;s new plugin shop. Some of these settings have the ability to powerfully affect the display of your BuddyPress site, so its creators warn users to try it on a test environment before going live with their selections. The team plans to add more options to the plugin in the future. You can download <a href=\"https://wordpress.org/plugins/buddyextender/\" target=\"_blank\">BuddyExtender</a> for free from WordPress.org.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 02 May 2016 22:33:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:121:\"WPTavern: Customize Posts Plugin and Selective Refresh are Paving the Way for Front-End Editing Powered by the Customizer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54345\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:131:\"http://wptavern.com/customize-posts-plugin-and-selective-refresh-are-paving-the-way-for-front-end-editing-powered-by-the-customizer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5016:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/05/customize-posts.jpg\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/05/customize-posts.jpg?resize=1024%2C583\" alt=\"photo credit: Paintbrush - (license)\" class=\"size-full wp-image-54351\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/93249705@N03/13067171403\">Paintbrush</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nd/2.0/\">(license)</a>\n<p>Last week Weston Ruter and the folks at XWP released <a href=\"https://make.xwp.co/2016/04/29/customize-posts-v0-5-released/\" target=\"_blank\">Customize Posts version 0.5</a>, which includes a new framework for postmeta and the ability to preview featured images. The feature <a href=\"https://wordpress.org/plugins/customize-posts/\" target=\"_blank\">plugin</a> aims to <a href=\"https://core.trac.wordpress.org/ticket/34923\" target=\"_blank\">introduce basic content authorship in the Customizer</a> to improve the new user site setup experience and make it easier to edit existing content.</p>\n<p>As of 0.5, Customize Posts supports the ability to change and preview the page template, and will sync changes back to the metabox on the page edit screen. It also supports changing the post author, excerpt, and comment/ping status, with live previews and changes saved to the editor. Check out Ruter&#8217;s screencast touring the plugin&#8217;s newest capabilities:</p>\n<div class=\"embed-wrap\"></div>\n<h3>Front-End Editing Powered by the Customizer: A Not-Too-Distant Possibility</h3>\n<p>With all these advanced editing capabilities, it doesn&#8217;t take a giant leap to imagine a future where the customizer provides the architecture for a front-end post editor. While WordPress&#8217; <a href=\"https://make.wordpress.org/design/tag/front-end-editor/\" target=\"_blank\">front-end editor project</a> seems to have gone dormant, improvements to the Customizer are steadily chipping away at the various aspects of content authorship that are not yet editable on the frontend.</p>\n<p>&#8220;Now that we have the ability to selectively refresh elements without doing full page reloads, this opens the door to using these Customizer components outside of the Customizer itself, such as in the frontend,&#8221; Ruter said.</p>\n<p>Front-end editing of partials, which are similar to customizer controls but exist in the preview, is a natural extension of the selective refresh architecture and a concept that Ruter will be exploring in the near future.</p>\n<p>&#8220;Consider, for example, being logged-in on the frontend,&#8221; Ruter said. &#8220;You see something you want to edit and you click on it. Since the Customizer partials all have selectors associated with them, if the partials are registered with each logged-in frontend request, then there are containers that can be targeted for editing.&#8221;</p>\n<p>Ruter envisions that clicking on an element would load the controls for that element on demand via a lazy-loaded Customizer pane or a floating control. He said that this would work in concert with customizer transactions (aka snapshots) to store the changes persistently in a transaction.</p>\n<p>Front-end editing powered by the customizer, according to Ruter, would involve the following:</p>\n<ol>\n<li>Being able to click Customize in the admin bar to lazy-load the Customizer pane&#8217;s controls into the existing page without having to having to navigate to `customize.php`</li>\n<li>Being able to click on individual containers that have associated partials to start editing controls that relate to those partials</li>\n<li>All changes made on the frontend to be persisted in a transaction draft that is initialized on demand</li>\n</ol>\n<p>The ability to edit posts in the customizer on the front-end isn&#8217;t going to happen overnight, but Ruter thinks a proof of concept could be available this year.</p>\n<p>&#8220;It&#8217;s going to take some discovery and prototyping, similar to Customize Posts,&#8221; Ruter said. &#8220;My guess is there would be something to play around with in Q3, depending on other projects and having enough time to put down on paper these ideas that have been floating around for a couple years.&#8221;</p>\n<p>An important step towards making that possible will be getting <a href=\"https://core.trac.wordpress.org/ticket/34923\" target=\"_blank\">basic content authorship added to the Customizer</a>, which Ruter and contributors are working towards for the upcoming WordPress 4.6 release.</p>\n<p>These will be welcome changes for those who are looking to do more on the frontend, but it still leaves the bulk of content editing behind the admin. Unless you&#8217;re a developer who follows every update to the customizer, it&#8217;s still confusing for the average WordPress user to know what content can be edited on the frontend vs. content that requires returning to the admin. The editing experience will remain disjointed until the majority of tasks can be done on the frontend.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 02 May 2016 18:15:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"WPTavern: Templatic Hacked, Files and Databases Compromised\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54339\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"http://wptavern.com/templatic-hacked-files-and-databases-compromised\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2362:\"<p><a href=\"https://templatic.com\">Templatic</a>, a WordPress commercial theme company, <a href=\"https://templatic.com/news/our-site-was-hacked/\">reported on</a> Saturday, April 30th, that its site was hacked. Files and databases containing customer usernames and passwords were compromised. According to R. Bhavesh, founder of Templatic, the data is being held for ransom money.</p>\n<blockquote><p>The hacker is now threatening us via email and demanding ransom money be paid. This hacker is also threatening to misuse the data they’ve illegally gained access to and email our data to customers.</p>\n<p>While this is a very serious and dangerous threat, we are not going to give in to threats and we will not be negotiating with any hacker and that’s no matter how much they try.</p></blockquote>\n<p>Bhavesh is working with local authorities and security experts who are investigating the matter. Since transactions on Templatic are handled directly by PayPal or 2Checkout, hackers were not able to obtain credit card information.</p>\n<h2>Customers Should Immediately Change Their Passwords</h2>\n<p>If you&#8217;ve ever shared cPanel, FTP, or wp-admin, login credentials with Templatic, you should immediately change your passwords. If you are using a product that relies on the Tevolution plugin and haven&#8217;t updated yet, you should <a href=\"https://templatic.com/news/security-vulnerability-found-themes/\">do so immediately</a>.</p>\n<p>Customers are advised to ignore emails sent from Templatic, &#8220;The email we sent today is the last email we will send regarding this matter. Anything further, we will share it on our social mediate accounts at <a href=\"https://twitter.com/templatic\">twitter</a>, <a href=\"https://www.facebook.com/templatic\">facebook</a> and <a href=\"https://templatic.com/blog\">our official blog</a> here,&#8221; Bhavesh said.</p>\n<p>Customers are also advised to create a full backup of their sites and use a <a href=\"https://sitecheck.sucuri.net//\">free site scanning tool</a> to scan for unknown files. Bhavesh apologized for what happened and says he accepts full responsibility, &#8220;I take up the responsibility of this and I sincerely apologize to each single one of our customers. We assure you that we are taking best security measures and fight this, no matter what.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 02 May 2016 17:18:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WPTavern: WordPress is Now 100% Translated Into Marathi\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54325\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"http://wptavern.com/wordpress-is-now-100-translated-into-marathi\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2089:\"<p>The Polyglots team announced this week that <a href=\"https://mr.wordpress.org/\" target=\"_blank\">WordPress is now 100% translated into Marathi</a>, an Indian language with an estimated 73 million native speakers. Marathi is one of the official languages of Western India and is the <a href=\"https://en.wikipedia.org/wiki/List_of_languages_by_number_of_native_speakers\" target=\"_blank\">19th most spoken language in the world</a> ranked by the number of native speakers.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/wp-in-marathi.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/wp-in-marathi.png?resize=1025%2C252\" alt=\"wp-in-marathi\" class=\"aligncenter size-full wp-image-54327\" /></a></p>\n<p>Less than a week ago, the Marathi translation was at just 10%, but the new translation teams rallied during the <a href=\"http://wptavern.com/global-wordpress-translation-day-draws-448-participants-from-105-countries\" target=\"_blank\">Global WordPress Translation Day</a> event to complete it in a matter of days. According to organizer Petya Raykovska, “India was the big surprise with four of the big Indian languages getting new contributors, forming teams, and connecting across India with one another to collaborate live.”</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Last year Hindi was far from 100%. Today 8 events in India translate to bo_IN, hi_IN, mr, gu, ml <a href=\"https://twitter.com/hashtag/WPTranslationday?src=hash\">#WPTranslationday</a> <a href=\"https://t.co/Lq5DoJrf0Q\">pic.twitter.com/Lq5DoJrf0Q</a></p>\n<p>&mdash; Petya Raykovska (@petyeah) <a href=\"https://twitter.com/petyeah/status/724103477002166272\">April 24, 2016</a></p></blockquote>\n<p></p>\n<p>Thanks to the eight local translation team events in India, Marathi received a strong enough push to get all WordPress strings translated at 100% just a few days after the event concluded. Hindi is also now at 100% and the other Indian languages are off to a good start with the newly-formed translation teams.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 29 Apr 2016 21:48:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: Create Beer Menus with the Easy Beer Lister Plugin for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54030\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"http://wptavern.com/create-beer-menus-with-the-easy-beer-lister-plugin-for-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5072:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/05/beer.jpg\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/05/beer.jpg?resize=869%2C415\" alt=\"beer\" class=\"aligncenter size-full wp-image-43810\" /></a></p>\n<p>The explosion of the craft beer scene in recent years means that more breweries and beer bars are <a href=\"http://wptavern.com/30-beautiful-brewery-websites-built-with-wordpress\" target=\"_blank\">building their websites on WordPress</a>. What are you looking for when you visit one of these websites? Why, the beer of course! Unfortunately, with the demands of brewing and serving customers, owners of these establishments don&#8217;t always have time to update their available beers.</p>\n<p>The <a href=\"https://wordpress.org/plugins/easy-beer-lister/\" target=\"_blank\">Easy Beer Lister</a> plugin was created to help breweries keep their information up-to-date. It offers an easy way for users to organize beer on on their websites with the additional benefit of being able to create beer menus with the same information. The menus are mobile friendly and can be printed or displayed on a TV screen.</p>\n<p>Alex Standiford initially started on this project out of a desire to improve his WordPress plugin development skills, but it quickly grew from there once he learned how difficult it is for brewers to keep their beer information up-to-date across all of their mediums.</p>\n<p>&#8220;Many breweries copy/paste their beer menu to their website, or simply don’t update their website at all,&#8221; Standiford said. &#8220;I even heard of a brewer who was staying up late every Friday to update his powerpoint presentation for his beer menu!</p>\n<p>&#8220;Once I realized how much time this was taking from the busy brewery owner, I knew that I needed to do something better than what others have done. I needed to provide them with a single place to update their beer information, where they could efficiently display it to customers in many different ways.&#8221;</p>\n<p>Easy Beer Lister adds a Beer Post Type to your WordPress site with special fields for ABV, OG, IBU, Untappd URL, video, and an image gallery.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/beer-post-type-easy-beer-lister.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/beer-post-type-easy-beer-lister.png?resize=793%2C476\" alt=\"beer-post-type-easy-beer-lister\" class=\"aligncenter size-full wp-image-54312\" /></a></p>\n<p>Beer styles can be added as categories and beer pairings as tags. Availability can also be specified via a custom taxonomy using terms such as On-Tap, Spring, Summer, Year-Round, etc. Beers take on the design of the active theme, but you can further customize the post type to improve its display. The plugin comes with a few basic templates, but Standiford is also creating more that can be added on.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/beer-page.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/beer-page.png?resize=1025%2C826\" alt=\"beer-page\" class=\"aligncenter size-full wp-image-54314\" /></a></p>\n<p>Once beers are organized and added to WordPress, users can create custom beer menus to display available beers. Sorting methods, such as availability, food pairings, and what&#8217;s on tap, can be bulk-edited in the admin.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/beer-menu.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/beer-menu.png?resize=1025%2C577\" alt=\"beer-menu\" class=\"aligncenter size-full wp-image-54317\" /></a></p>\n<p>Easy Beer Lister also includes shortcodes for displaying a specific beer or a list of beers:</p>\n<ul>\n<li><strong>[beer]</strong> &#8211; Create a URL to a specified beer. The link also shows a preview of the beer when you hover over it with your mouse.</li>\n<li><strong>[beer_list]</strong> &#8211; Create a list of beers based on specified parameters, such as style or pairings.</li>\n</ul>\n<p>Standiford plans to open a marketplace for GPL add-ons that extend Easy Beer Lister. <a href=\"http://www.easybeerlister.com/downloads/untappd-importer/\" target=\"_blank\">Untappd Importer</a> is his first add-on, which makes it easy for breweries to get started without having to manually enter all of their beers.</p>\n<p>&#8220;With this add-on, I was able to import all 600+ beers from Dogfish Head Brewing’s Untappd page in about three minutes, including the ABV and IBU information,&#8221; Standiford said. He is working on other add-ons such as a beer image generator, an Instagram photo import function, and a bartender suite that allows bartenders to access a page to add/remove beers from the tap menu/website quickly.</p>\n<p>&#8220;The plugin is more than a tool to help brewers manage their beer on their website,&#8221; Standiford said. &#8220;I aim to use it to dramatically reduce the amount of time a brewer spends updating beer information on all facets of their business.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 29 Apr 2016 18:46:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"WPTavern: WordCamp Organizers Get New Tool for Creating Personalized WordCamp Badges\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54270\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"http://wptavern.com/wordcamp-organizers-get-new-tool-for-creating-personalized-wordcamp-badges\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3947:\"<p>Creating personalized WordCamp badges for attendees has traditionally been a time-consuming task for event organizers. Last year the community held 89 WordCamps with 21,000 attendees, and each person received a name badge customized for the event they participated in. That&#8217;s a massive number of badges to prepare for printing.</p>\n<p>In the past, WordCamp organizers <a href=\"https://make.wordpress.org/community/handbook/wordcamp-organizer-handbook/first-steps/helpful-documents-and-templates/create-wordcamp-badges-with-gravatars/personalized-badges-with-indesign/\" target=\"_blank\">used an InDesign template for making the badges</a>, but this required a tedious process of creating a CSV file of attendees, running a custom script, and completing a list of complicated steps. George Stephanis, who had experience using the InDesign template, wanted to simplify this process for organizers and help them move away from having to use a proprietary, commercial software product.</p>\n<p>He <a href=\"https://make.wordpress.org/community/2016/02/12/name-badges-are-hard-to-make-and-confusing-for-organizers/\" target=\"_blank\">built a proof-of-concept plugin</a> that allows organizers to create badges with HTML and CSS inside the WordPress admin. After several iterations and contributions from the community team, Ian Dunn <a href=\"https://make.wordpress.org/community/2016/04/26/new-tool-for-creating-personalized-wordcamp-badges/\" target=\"_blank\">announced</a> that the tool is now ready for use.</p>\n<p>WordCamp organizers can access the tool under Tickets > Tools > Generate Badges or by navigating through the Customizer to the CampTix HTML Badges panel. The default badge design is shown below with the back of the badge (upside-down) and the front beneath it with a marker for poking the lanyard holes. User names and gravatars are automatically displayed.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/wordcamp-badges-with-html-css.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/wordcamp-badges-with-html-css.png?resize=900%2C783\" alt=\"wordcamp-badges-with-html-css\" class=\"aligncenter size-full wp-image-54285\" /></a></p>\n<p>Stephanis included the CodeMirror bundled with Jetpack’s Custom CSS module to make it easier for organizers to customize the badge design to suit the theme of the WordCamp. The plugin also makes it fairly easy to customize any aspect of the badge using CSS.</p>\n<p>&#8220;The underlying markup has plenty of CSS classes to help with customization,&#8221; Dunn said. &#8220;For example, you could make volunteer badges have a different background color (so that volunteers are easier to find), or make attendees&#8217; last names appear in a smaller font than their first names. There are also plenty of empty &lt; div > elements that you can re-purpose for arbitrary design features.&#8221;</p>\n<p>Once the design is finished, organizers can export as a PDF and take it to a print shop. Documentation for customizing the badges is <a href=\"https://make.wordpress.org/community/handbook/wordcamp-organizer-handbook/first-steps/helpful-documents-and-templates/create-wordcamp-badges-with-gravatars/personalized-badges-with-html-css/\" target=\"_blank\">available in the WordCamp Organizer handbook</a>.</p>\n<p>Organizers are still welcome to use the InDesign tool to create badges, but the new plugin for the customizer is a much easier entry point for those who aren&#8217;t familiar with InDesign. If you can help improve the tool, the code is open source on the <a href=\"https://meta.svn.wordpress.org/sites/trunk/wordcamp.org/public_html/wp-content/plugins/camptix-badge-generator\" target=\"_blank\">Meta repository</a> and <a href=\"https://make.wordpress.org/community/handbook/wordcamp-organizer-handbook/first-steps/web-presence/contributing-to-wordcamp-org/\" target=\"_blank\">available for anyone to patch</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 28 Apr 2016 23:15:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"WPTavern: WordCamp Tokyo 2016 Calls for Speakers, Adds New English Track\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54145\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"http://wptavern.com/wordcamp-tokyo-2016-calls-for-speakers-adds-new-english-track\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2318:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/wordcamp-tokyo.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/wordcamp-tokyo.png?resize=1025%2C506\" alt=\"wordcamp-tokyo\" class=\"aligncenter size-full wp-image-54265\" /></a><br />\n<a href=\"https://2016.tokyo.wordcamp.org/\" target=\"_blank\">WordCamp Tokyo 2016</a> will be held September 17-18 at the <a href=\"http://www.bellesalle.co.jp/room/bs_shinjukugrand/\" target=\"_blank\">Bellesalle Shinjuku Grand</a>. This will be the 9th edition of the event, which sold out last year with 750 attendees.</p>\n<p>Yesterday the WordCamp&#8217;s organizers put out a <a href=\"https://2016.tokyo.wordcamp.org/04/27/call-for-speakers-en/\" target=\"_blank\">call for both for English and Japanese speakers</a>. Last year the event hosted a selection of <a href=\"https://2015.tokyo.wordcamp.org/session/6-3/\" target=\"_blank\">English sessions</a>, but the 2016 edition will add a dedicated track for English speakers with simultaneous interpretation.</p>\n<p>The WordCamp will be broken into three tracks: User, Technical, and Global. Descriptions and example topics for each are available in the <a href=\"https://2016.tokyo.wordcamp.org/04/27/call-for-speakers-en/\" target=\"_blank\">post</a> calling for speakers. All English language presentations will be placed under the Global track but speakers are welcome to submit any topic.</p>\n<p>The theme of WordCamp Tokyo 2016 is &#8220;breaking dawn.&#8221; With the advent of the WP REST API and the recent surge in WordPress-powered application development, the WordPress community is entering a new era. Organizers have selected a motto as part of the theme:</p>\n<p>&#8220;<em>Let’s try something new</em>,” said organizer Toru Miki. &#8220;That is the message we want to get across to the WordCamp Tokyo 2016 attendees. Our goal is to offer sessions that can motivate and stimulate them, just like the beam of sunlight in the dawn.&#8221;</p>\n<p>If you want to attend one of the biggest WordCamps on the planet and you have a topic that you think can inspire attendees, the speaker application deadline is Friday, June 10. Presentations can be 15 minutes, 30 minutes, or 75 minutes. Applicants will be notified of their acceptance status by mid-July.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 28 Apr 2016 20:38:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"WPTavern: WPWeekly Episode 232 – Recap of WordCamp San Diego 2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=54156&preview_id=54156\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://wptavern.com/wpweekly-episode-232-recap-of-wordcamp-san-diego-2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2847:\"<p>In this episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I discuss the news of the week as our guest couldn&#8217;t make it.</p>\n<p>Marcus shares his experience at WordCamp San Diego this past weekend and offers feedback to the organizing team. We let you know what&#8217;s in the recently released WordPress update and discuss what happens to the data WordPress.org collects from users sites. As usual, Marcus ends the show with his plugin picks of the week.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/wordpress-4-5-1-fixes-12-bugs\">WordPress 4.5.1 Fixes 12 Bugs</a><br />\n<a href=\"http://wptavern.com/global-wordpress-translation-day-draws-448-participants-from-105-countries\">Global WordPress Translation Day Draws 448 Participants from 105 Countries</a><br />\n<a href=\"http://wptavern.com/wordpress-for-ios-adds-geotag-support-comment-moderation-gestures\">WordPress for iOS Adds Geotag Support, Comment Moderation Gestures</a><br />\n<a href=\"http://wptavern.com/wordpress-4-6-to-update-theme-filter-tags-in-the-admin\">WordPress 4.6 to Update Theme Filter Tags in the Admin</a><br />\n<a href=\"http://wptavern.com/what-wordpress-org-does-with-the-data-it-collects-from-users-sites\">What WordPress.org Does with the Data it Collects from Users Sites</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/video-gallery-awesome-responsive-youtube-vimeo-gallery/\">Video Gallery &#8211; YouTube and Vimeo Video Gallery </a>is a responsive plugin that allows you to show YouTube and Vimeo videos in various formats.</p>\n<p><a href=\"https://wordpress.org/plugins/on-sale-page-for-woocommerce/\">OnSale Page for WooCommerce </a>is an extension for WooCommerce that enables you to have a On Sale page with paging, sorting, and filtering options.</p>\n<p><a href=\"https://wordpress.org/plugins/embed-google-adwords-codes-on-woocommerce/\">Embed Google AdWords Codes on WooCommerce </a>enables users to implement Google AdWords conversion tracking to determine how effective ads are. It provides information such as the number of clicks that are generating sales.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, May 4th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #232:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 28 Apr 2016 06:24:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: Array Cuts Theme Club Pricing, Releases Free Theme Pack\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54083\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"http://wptavern.com/array-cuts-theme-club-pricing-releases-free-theme-pack\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4007:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/array-logo.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/array-logo.png?resize=956%2C440\" alt=\"array-logo\" class=\"aligncenter size-full wp-image-54154\" /></a></p>\n<p>Array <a href=\"https://arraythemes.com/welcome-to-array-3-0/\" target=\"_blank\">launched a redesign</a> of its theme shop this week along with drastic price cuts for single theme and club purchases. After conducting a <a href=\"https://arraythemes.com/complete-a-brief-survey-for-50-off/\" target=\"_blank\">customer survey</a> earlier this year, the company moved to act on feedback regarding its pricing structure.</p>\n<p>Previously, Array offered single theme purchases ranging in price from $49 to $89 and the entire collection for $199. The new pricing is more straightforward with all single themes at $49 and club membership for $89.</p>\n<p>The company, which began under the name Okay Themes and rebranded two years ago, announced last April that it would be <a href=\"http://wptavern.com/array-returns-to-themeforest-after-disappointing-experiences-selling-on-creative-market-and-wordpress-com\" target=\"_blank\">returning to Themeforest</a> after disappointing experiences selling on Creative Market and WordPress.com. Array currently has five items in its <a href=\"http://themeforest.net/user/arraythemes/portfolio\" target=\"_blank\">portfolio on Themeforest</a> ranging in price from $44-64. The company negotiated an agreement with the marketplace that gives them a better rate than other non-exclusive authors typically receive.</p>\n<p>&#8220;Although I can’t go into this in too much detail, we are actually not operating at the typical non-exclusive author rates, as most would rightfully assume,&#8221; founder Mike McAlister said in a <a href=\"http://wptavern.com/array-returns-to-themeforest-after-disappointing-experiences-selling-on-creative-market-and-wordpress-com#comment-66896\" target=\"_blank\">comment</a> on our post about the news. &#8220;We’ve worked out a mutually beneficial agreement with Envato that gives us a little more room for experimentation and bandwidth for providing quality support.&#8221;</p>\n<p>With equal or more affordable pricing at Themeforest, customers had little incentive to buy directly from the Array website with the previous pricing structure in place. The new $89 club membership is now more compelling for those who are interested in purchasing multiple themes directly from Array.</p>\n<p>In addition to the the redesign and new pricing, Array released a free theme pack to help potential customers get acquainted with their products before purchasing. The pack includes five of their most popular themes, some of which were not previously offered for free, including Author, Editor, Fixed, Typable and Transmit. Editor is also available on WordPress.org and WordPress.com.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/free-theme-pack.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/free-theme-pack.jpg?resize=1025%2C772\" alt=\"free-theme-pack\" class=\"aligncenter size-full wp-image-54143\" /></a></p>\n<p>Array&#8217;s journey over the past two years, which includes pulling out of Themeforest, rebranding, and then jumping back into the marketplace with a more beneficial arrangement, necessitated an update in its pricing structure in order to remain competitive. Customers gravitate towards straightforward pricing that they can understand, especially when products are sold across multiple marketplaces.</p>\n<p>The theme shop&#8217;s experimentation with selling on Themeforest, WordPress.com, Creative Market, Mojo Marketplace, and Array&#8217;s own website shows how much it has had to adapt to reach potential customers. Commercial WordPress themes are a multi-million dollar industry, but there&#8217;s no single avenue paved to success even when partnering with one of the dominant marketplaces.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 28 Apr 2016 05:32:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Matt: You Yourself\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46523\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://ma.tt/2016/04/you-yourself/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:419:\"<blockquote><p>You yourself, as much as anybody in the entire universe, deserve your love and affection.</p></blockquote>\n<p>This quote is almost always attributed to Buddha. <a href=\"http://fakebuddhaquotes.com/you-yourself-as-much-as-anybody-in-the-entire-universe-deserve-your-love-and-affection/\">Luckily there&#8217;s a great WordPress site called Fake Buddha Quotes that tracks down its actual provenance</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Apr 2016 21:55:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"Matt: Secret History of Tiger Woods\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46519\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://ma.tt/2016/04/secret-history-of-tiger-woods/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:283:\"<p>ESPN has a fascinating longread on <a href=\"http://espn.go.com/espn/feature/story/_/id/15278522/how-tiger-woods-life-unraveled-years-father-earl-woods-death\">The Secret History of Tiger Woods, especially in the context of his relationship with and the death of his father</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Apr 2016 03:33:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"WPTavern: A 42-Year-Old Developer’s Advice on Working in Tech\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54077\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"http://wptavern.com/a-42-year-old-developers-advice-on-working-in-tech\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5455:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/glasses-computer.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/glasses-computer.jpg?resize=960%2C557\" alt=\"photo credit: Aliis Sinisalu\" class=\"size-full wp-image-54120\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/2SLJBDK4T0\">Aliis Sinisalu</a>\n<p><a href=\"https://twitter.com/akosma\" target=\"_blank\">Adrian Kosmaczewski</a>, a 42-year-old, self-taught developer, published an article today titled <a href=\"https://medium.com/@akosma/being-a-developer-after-40-3c5dd112210c#.5nju9pdg8\" target=\"_blank\">Being A Developer After 40</a>. The piece is full of sage advice that is resonating with developers of all ages. His post is a summary of a talk he gave at the <a href=\"https://www.appbuilders.ch/\" target=\"_blank\">App Builders Switzerland</a> conference in April with the accompanying slides <a href=\"https://speakerdeck.com/akosma/being-a-developer-after-40\" target=\"_blank\">available on Speaker Deck</a>.</p>\n<p>Kosmaczewski gives readers a glimpse into what the world of technology was like in 1997, the year he began his career as a developer before the days of unit tests and continuous integration, before SVN even existed.</p>\n<blockquote><p>My first job consisted of writing ASP pages in various editors, ranging from Microsoft FrontPage, to HotMeTaL Pro to EditPlus, managing cross-browser compatibility between Netscape Navigator and Internet Explorer 4, and writing stored procedures in SQL Server 6.5 powering a commercial website published in Japanese, Russian, English and Spanish — without any consistent UTF-8 support across the software stack.</p></blockquote>\n<p>If you worked as a developer in those days you may fondly remember working with some of these technologies. Since then, countless new ones have been introduced but the requirement to keep learning remains unchanged. Kosmaczewski offers advice on navigating the hype surrounding the newest programming languages.</p>\n<blockquote><p>Do not worry about hype. Keep doing your thing, keep learning what you were learning, and move on. Pay attention to it only if you have a genuine interest, or if you feel that it could bring you some benefit in the medium or long run.</p></blockquote>\n<p>It&#8217;s easy to get overwhelmed with all the new languages and frameworks that people say you need to learn in order to stay relevant, but Kosmaczewski encourages readers to follow their own interests and learn about software history. Otherwise, you&#8217;ll be forever chasing new architectures and ideas but never learning them in depth or gaining more than a shallow understanding of their implementation.</p>\n<p>In an industry where professionals are valued by their abilities in specific languages, many programmers allow their identity to be wrapped up in the tools they use. Kosmaczewski encourages readers to be ready to change course:</p>\n<blockquote><p>Do not criticize or make fun of the technology choices of your peers; for other people will have their own reasons to choose them, and they must be respected. Be prepared to change your mind at any time through learning. One day you might like Windows. One day you might like Android. I am actually liking some parts of Android lately. And that is OK.</p></blockquote>\n<p>His perspective comes from nearly 20 years of working as a developer. The lesson I saw in this section of his essay is that the technologies you work with are part of your journey, and you&#8217;ll cycle through many of them. However, be careful not to allow them to become your whole identity, because you are still learning.</p>\n<h3>The Value of Teaching</h3>\n<p>One of the most inspiring parts of his post is the section on teaching. We often hear the saying, &#8220;Those who can, do; those who can&#8217;t, teach,&#8221; thrown around smugly, but this devalues educators. Teaching is somewhat of a lost art in an industry where many professionals are self-taught. Yet, Kosmaczewski says there are some things you cannot learn without having taught someone else:</p>\n<blockquote><p>Teaching will make you more humble, because it will painfully show you how limited your knowledge is. Teaching is the best way to learn. Only by testing your knowledge against others are you going to learn properly. This will also make you more respectful regarding other developers and other technologies; every language, no matter how humble or arcane, has its place within the Tao of Programming, and only through teaching will you be able to feel it.</p></blockquote>\n<p>Kosmaczewski also shares some moving stories of how his teaching and mentoring have made a difference in the world, especially for those who are just beginning.</p>\n<p>If you have a few minutes, I highly recommend reading &#8220;<a href=\"https://medium.com/@akosma/being-a-developer-after-40-3c5dd112210c#.5nju9pdg8\" target=\"_blank\">Being A Developer After 40</a>.&#8221; This article is a window into one developer&#8217;s journey but his advice and habit recommendations are relevant to everyone from experienced programmers to those just starting out. Kosmaczewski explores some of the darker aspects of the industry but also the beauty of sticking with it. His closing statement sums it up nicely:</p>\n<blockquote><p>As long as your heart tells you to keep on coding and building new things, you will be young, forever.</p></blockquote>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Apr 2016 21:41:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"WPTavern: WordPress 4.5.1 Fixes 12 Bugs\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54104\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://wptavern.com/wordpress-4-5-1-fixes-12-bugs\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1121:\"<p>WordPress 4.5.1 <a href=\"https://wordpress.org/wordpress-4.5.1.zip\">is available</a> and <a href=\"https://wordpress.org/news/2016/04/wordpress-4-5-1-maintenance-release/\">addresses a dozen items</a> reported against WordPress 4.5. According to Adam Silverstein, &#8220;a singular class issue that broke sites based on the Twenty Eleven theme, an incompatibility between certain Chrome versions and the visual editor, and an Imagick bug that could break media uploads,&#8221; are among the bugs fixed. A detailed list of changes can be <a href=\"https://core.trac.wordpress.org/log/branches/4.5?rev=37295&stop_rev=37182\">viewed here</a>.</p>\n<p>WordPress 4.5.1 is already being pushed out to sites configured for auto updates. If you&#8217;d rather not wait or have auto updates disabled, you can browse to Dashboard &#8211; Updates and click the Update Now button. If you encounter an issue or believe you&#8217;ve discovered a bug, please post it in the <a href=\"https://wordpress.org/support/forum/how-to-and-troubleshooting\">troubleshooting section</a> of the support forums.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Apr 2016 19:54:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"WPTavern: Global WordPress Translation Day Draws 448 Participants from 105 Countries\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54010\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"http://wptavern.com/global-wordpress-translation-day-draws-448-participants-from-105-countries\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7593:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/wordpress-global-translation-day.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/wordpress-global-translation-day.png?resize=1025%2C511\" alt=\"wordpress-global-translation-day\" class=\"aligncenter size-full wp-image-54040\" /></a></p>\n<p>The first <a href=\"https://wptranslationday.org/\" target=\"_blank\">Global WordPress Translation Day</a> was held over the weekend, organized by the Polyglots team. The event included 24 hours of live training sessions and translation sprints that spanned every timezone from East to West. The goal was to grow the translation teams and educate new translators with live training sessions.</p>\n<p>During the course of the event, 448 translators from 105 countries translated 40,350 new strings across 597 projects. This includes WordPress core and open source plugins and themes, such as Pods, Google Two-Factor Authentication, WooCommerce, bbPress, Yoast SEO, and hundreds of others.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\"><a href=\"https://twitter.com/hashtag/WPTranslationDay?src=hash\">#WPTranslationDay</a> in Japan &#8211; Our collective achievement today: of top 100, 20 plugins/62 plugins are now translated in Japanese.</p>\n<p>&mdash; Naoko Takano (@naokomc) <a href=\"https://twitter.com/naokomc/status/724180025033940992\">April 24, 2016</a></p></blockquote>\n<p></p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/japan-thailand-wptranslation-day.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/japan-thailand-wptranslation-day.png?resize=1025%2C766\" alt=\"Japan and Thailand live streaming each other\'s events -  photo credit: Menn Studio\" class=\"size-full wp-image-54075\" /></a>Japan and Thailand live streaming each other&#8217;s events &#8211;  photo credit: <a href=\"https://twitter.com/MennStudio/status/724151092771065857\">Menn Studio</a>\n<p>&#8220;We had 39 local events and 11 remote events happening across the globe,&#8221; organizer Petya Raykovska said. &#8220;India was the big surprise with four of the big Indian languages getting new contributors, forming teams and connecting across India with one another to collaborate live.&#8221;</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Last year Hindi was far from 100%. Today 8 events in India translate to bo_IN, hi_IN, mr, gu, ml <a href=\"https://twitter.com/hashtag/WPTranslationday?src=hash\">#WPTranslationday</a> <a href=\"https://t.co/Lq5DoJrf0Q\">pic.twitter.com/Lq5DoJrf0Q</a></p>\n<p>&mdash; Petya Raykovska (@petyeah) <a href=\"https://twitter.com/petyeah/status/724103477002166272\">April 24, 2016</a></p></blockquote>\n<p></p>\n<p>All of the sessions were live streamed and the team had 316 people who watched the broadcast at some point during the day. The event featured 12 training sessions in different languages to teach participants how to translate WordPress core, including Japanese, Hindi, Bulgarian, German, Slovak, French, Spanish, Portuguese, Swedish, Dutch, Lithuanian and Italian.</p>\n<p>The other sessions focused on topics for plugin and theme developers, such as:</p>\n<ul>\n<li>Plugin documentation and support for the whole world</li>\n<li>How to find translators for your plugins and themes</li>\n<li>Localization – Beyond Translation </li>\n<li>The life of a string – or how WordPress gets its translations</li>\n<li>Plugin/Theme i18n: How to prepare your plugin or theme for translate.wordpress.org</li>\n<li>GlotDict – how a browser extension changes your translation workflow</li>\n</ul>\n<p>All of the videos from the event are <a href=\"https://www.crowdcast.io/e/wptranslationday\" target=\"_blank\">available on Crowdcast.io</a> if you want to learn more about the WordPress Polyglots team and how everyone works together. One of the best outcomes of the day, according to Raykovska, is that translation teams now have video documentation for new contributors. They plan to upload the videos to WordPress.tv and include them in the Polyglots handbook.</p>\n<h3>Global WordPress Translation Day Offers a New Avenue for Contributing to Translations</h3>\n<p>&#8220;We do contributor days around WordCamps and then the community summit once a year,&#8221; Raykovska said. &#8220;The contributor summit hasn’t been super productive for Polyglots so far. Unlike most other teams, most contributors are 100% volunteers and can’t afford (or get a Visa) for a trip to the US.</p>\n<p>&#8220;So we wanted to organize a contributor day without these restrictions for participants,&#8221; she said. &#8220;And that’s how the idea was born.&#8221;</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Staring at the top of the pile of strings we translated during the Dutch <a href=\"https://twitter.com/hashtag/wptranslationday?src=hash\">#wptranslationday</a> meetup! <a href=\"https://twitter.com/hashtag/community?src=hash\">#community</a> <a href=\"https://t.co/hnC3OJsHTS\">pic.twitter.com/hnC3OJsHTS</a></p>\n<p>&mdash; Taco Verdo (@TacoVerdo) <a href=\"https://twitter.com/TacoVerdo/status/724499512639782912\">April 25, 2016</a></p></blockquote>\n<p></p>\n<p>The Polyglots team has not set a date for the next Global WordPress Translation event, but Raykovska said it will be easier for them to organize now that they have the processes figured out. One of the most positive outcomes of this past weekend&#8217;s event is that it has sparked translation teams to organize more local events, especially now that they are armed with video documentation and training tools for plugin and theme developers.</p>\n<p>&#8220;Some countries are planning monthly contributor translation drives and standalone contributor days,&#8221; Raykovska said.</p>\n<blockquote class=\"instagram-media\"><div>\n<div>\n<div></div>\n</div>\n<p> <a href=\"https://www.instagram.com/p/BElHSiBB_KU/\" target=\"_blank\">#WPTranslationDay WordBench 東京。たくさん翻訳できました！</a></p>\n<p>A photo posted by Naoko Takano (@naokomc) on Apr 24, 2016 at 3:37am PDT</p>\n</div>\n</blockquote>\n<p></p>\n<p>Raykovska said next time she would like to get more people on screen from the events happening in different locations around the world. She also hopes to organize some round tables where Polyglots team members can share about their local processes and team structures.</p>\n<p>&#8220;I think we need to make a solid effort to bridge the gap between plugin authors and translators,&#8221; Raykovska said. &#8220;The demand for translations is growing, especially for the most used languages. An event like this would be a good reason for the two groups to gather and talk about what’s not quite working right now and think of ways to overcome it.&#8221;</p>\n<p>As many polyglots will be in attendance at WordCamp Europe, the team is considering organizing a gathering there. This multilingual WordPress event will be <a href=\"http://wptavern.com/wordcamp-europe-2016-expands-attendee-capacity-to-2200-largest-wordcamp-to-date\" target=\"_blank\">the largest WordCamp in history with 2200 attendees</a>. WordPress&#8217; rapidly growing international user base and the expanding Polyglots team could make the Global Translation Day event a catalyst for future improvements to the project.</p>\n<p>&#8220;If we can go one step further, it would be awesome to revive the conversation about multilingual in core,&#8221; Rakovska said. The success of this past weekend&#8217;s event shows the Polyglots&#8217; enthusiasm and determination to collaborate across borders to get things done.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Apr 2016 17:11:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"WPTavern: I’m Attending WordCamp Chicago, 2016, This Weekend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54065\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"http://wptavern.com/im-attending-wordcamp-chicago-2016-this-weekend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1872:\"<p><a href=\"https://2016.chicago.wordcamp.org/\">WordCamp Chicago 2016</a> takes place this weekend and I&#8217;ll be among the many attendees. I haven&#8217;t visited the city <a href=\"http://wptavern.com/my-wordcamp-chicago-experience\">since 2009</a> and I&#8217;m excited to satisfy my craving for deep dish pizza at <a href=\"http://www.loumalnatis.com/\">Lou Malnati&#8217;s</a>.</p>\n<p>WordCamp Chicago 2009 is a special memory because it&#8217;s where I saw a demo of <a href=\"http://www.gravityforms.com/\">Gravity Forms</a> before it launched to the public. At the time Contact Form 7 was a household name and the go-to plugin for creating forms. I knew it was going to be successful when I saw its user interface and how it worked. Seven years later, the plugin is still going strong.</p>\n<p>The GPL license was also hot topic at the time. During Matt Mullenweg&#8217;s State of the Word presentation, he announced that the WordPress Theme directory would have a section dedicated to theme shops that were 100% GPL. I remember hearing the room gasp during his announcement.</p>\n<p><a href=\"https://www.flickr.com/photos/jeffc316/3611592503/in/album-72157619302065170/\"><img src=\"http://i2.wp.com/farm4.staticflickr.com/3659/3611592503_8deb33cc39_z.jpg?resize=640%2C480&ssl=1\" alt=\"100_2303\" /></a></p>\n<p>In 2009, the WordPress commercial theme market was young and the GPL was a license many theme companies didn&#8217;t embrace. Having your company <a href=\"https://wordpress.org/themes/commercial/\">listed on a page</a> that gets a ton of traffic motivated at least a couple of theme shops to embrace the GPL.</p>\n<p>I&#8217;m looking forward to meeting new people this weekend and creating new memories. If you happen to see me, please stop and say hi. I&#8217;d love to talk to you about your experiences with WordPress.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Apr 2016 06:12:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: WordPress for iOS Adds Geotag Support, Comment Moderation Gestures\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=54024\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"http://wptavern.com/wordpress-for-ios-adds-geotag-support-comment-moderation-gestures\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2967:\"<p>WordPress for iOS 6.1 is <a href=\"https://itunes.apple.com/us/app/wordpress/id335703880?mt=8&uo=6&at=&ct=\">available from the App Store</a> and includes a number of improvements. Those who use Jetpack can now manage Publicize connections from within the app.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8539.png\"><img class=\"aligncenter size-large wp-image-54047\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8539.png?resize=282%2C500\" alt=\"Publicize Connections\" /></a>Comments can quickly be moderated thanks to gestures added to the notifications screen. Swiping left on a notification displays options to approve, unapprove, spam, or trash a comment.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/CommentModerationGestures.png\"><img class=\"size-large wp-image-54054\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/CommentModerationGestures.png?resize=281%2C500\" alt=\"Comment Moderation Gestures\" /></a>Comment Moderation Gestures\n<p>If you&#8217;ve connected multiple sites to the app, it can be cumbersome to navigate to the one you access most often. This version includes the ability to set up a primary site from within the Account Settings panel. During testing however, I noticed my version of the app doesn&#8217;t have this setting. I&#8217;m going through the support process to determine the cause.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8537.png\"><img class=\"size-large wp-image-54043\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8537.png?resize=282%2C500\" alt=\"Configure a Primary Site\" /></a>My Account Settings Page\n<p>A new UI element at the bottom of the post creation screen allows users to geotag a post. Simply type in an address or location into the search field and a map displays with the location data. The location is stored in the WordPress backend but can be displayed on the frontend if a theme supports it.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8538.png\"><img class=\"size-large wp-image-54044\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8538.png?resize=282%2C500\" alt=\"Geotag Support\" /></a>Geotag Support\n<p>A full list <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?q=is%3Aclosed+is%3Aissue+milestone%3A6.1+label%3A%22[Type]+Enhancement%22\">of changes</a> and <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?q=is%3Aclosed+is%3Aissue+milestone%3A6.1+label%3A%22[Type]+Bug%22\">bug fixes</a> is available on GitHub where you can also follow the <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?utf8=%E2%9C%93&q=is%3Aissue+milestone%3A6.2+\">progress of 6.2</a>. If you have any issues or think you&#8217;ve discovered a bug, please report it on the <a href=\"https://ios.forums.wordpress.org/\">WordPress for iOS support forums</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Apr 2016 04:03:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: WordPress 4.6 to Update Theme Filter Tags in the Admin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53952\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"http://wptavern.com/wordpress-4-6-to-update-theme-filter-tags-in-the-admin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2093:\"<p>The admin themes browser has been updated and modernized in recent years to make it easier to search through the 3,800+ themes available on WordPress.org. One aspect of the interface that has lagged behind, however, is the list of tags for filtering themes. The tags have gone untouched since back in the day when users would search themes by color.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/theme-tags.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/theme-tags.png?resize=1025%2C726\" alt=\"theme-tags\" class=\"aligncenter size-full wp-image-54013\" /></a></p>\n<p>The WordPress Theme Review Team&#8217;s <a href=\"https://core.trac.wordpress.org/ticket/33407\" target=\"_blank\">proposal to overhaul the outdated tags/filters</a> is making it into WordPress 4.6. All of the color tags will be removed, which makes sense since many modern themes are customizable when it comes to accent colors. The update will also remove fixed, fluid, and responsive layouts and will add &#8216;Grid Layout&#8217; to the list. In the list of miscellaneous features, Blavatar will be removed and Footer Widgets will be added.</p>\n<p>The Subject section will be completely revamped by removing the all the previous tags and replacing them with a new list of general theme categories:</p>\n<ul>\n<li>Blog</li>\n<li>E-Commerce</li>\n<li>Education</li>\n<li>Entertainment</li>\n<li>Food &#038; Drink</li>\n<li>Holiday</li>\n<li>News</li>\n<li>Photography</li>\n<li>Portfolio</li>\n</ul>\n<p>The tags will also be updated on the WordPress Theme Directory <a href=\"https://meta.trac.wordpress.org/ticket/1187\" target=\"_blank\">in cooperation with the meta team</a>.</p>\n<p>The WordPress theme landscape has changed so much over the years, especially with the introduction of the customizer, and this update will make it easier for users to narrow down themes they want to use. WordPress.org theme authors will want to be ready to update their themes as soon as the new tags are available so that they can be more easily found via search.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 25 Apr 2016 18:51:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"Matt: 538 on Basic Income\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46513\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"https://ma.tt/2016/04/538-on-basic-income/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:746:\"<blockquote><p>The economic uncertainty surrounding basic income is huge, and the politics of bringing such a program about on a large scale are daunting. But something makes this radical proposal so exciting that people and governments are increasingly willing to try it. Basic income challenges our notions of the social safety net, the relationship between work and income, and how to adapt to technological change. That makes it one of the most audacious social policy experiments in modern history. It could fail disastrously, or it could change everything for the better.</p></blockquote>\n<p>From FiveThirtyEight, <a href=\"http://fivethirtyeight.com/features/universal-basic-income/\">What Would Happen If We Just Gave People Money?</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 25 Apr 2016 15:12:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"WP Mobile Apps: WordPress for iOS: Version 6.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.com/?p=3375\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://apps.wordpress.com/2016/04/25/wordpress-for-ios-version-6-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3668:\"<p>Hi there, WordPress users! <a href=\"https://itunes.apple.com/us/app/wordpress/id335703880?mt=8&uo=6&at=&ct=\">Version 6.1 of the WordPress for iOS app</a> is now available in the App Store.</p>\n<h1>What&#8217;s New:</h1>\n<p><strong>Get social on the go!</strong> WordPress.com and Jetpack-enabled bloggers can manage Publicize and third-party sharing from within the app.</p>\n<p><strong>More gestures!</strong> Swipe notifications to approve, unapprove, and trash comments at the speed of your thumbs.</p>\n\n<a href=\"https://apps.wordpress.com/img_2189/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/04/img_2189.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Swipe left to unveil the new moderation options.\" /></a>\n\n<p><strong>Mobile friendly.</strong> Select your primary blog right from within the app.</p>\n\n<a href=\"https://apps.wordpress.com/img_2187-new/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/04/img_2187-new.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"You can select your primary site in \" /></a>\n<a href=\"https://apps.wordpress.com/img_2188/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/04/img_2188.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Pick it with a simple tap!\" /></a>\n\n<p><strong>Where’s Waldo? </strong>Search locations to tag GPS on posts.</p>\n\n<a href=\"https://apps.wordpress.com/img_2190-new/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/04/img_2190-new.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"GPS tag your posts!\" /></a>\n<a href=\"https://apps.wordpress.com/img_2191/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/04/img_2191.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Tap on \" /></a>\n<a href=\"https://apps.wordpress.com/img_2192/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/04/img_2192.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Use the search field to select the right location.\" /></a>\n\n<p><strong>Enhancements.</strong> Because &#8220;good&#8221; is not enough! Here&#8217;s the full <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?q=is%3Aclosed+is%3Aissue+milestone%3A6.1+label%3A%22%5BType%5D+Enhancement%22\">list of enhancements</a>.</p>\n<p><strong>Bug fixes.</strong> Tons of <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?q=is%3Aclosed+is%3Aissue+milestone%3A6.1+label%3A%22%5BType%5D+Bug%22\">bug fixes</a>!</p>\n<h1>Thank You</h1>\n<p>Thanks to all of the contributors who worked on this release:<br />\n<a href=\"https://github.com/aerych\">@aerych</a>, <a href=\"https://github.com/alexcurylo\">@alexcurylo</a>, <a href=\"https://github.com/astralbodies\">@astralbodies</a>, <a href=\"https://github.com/diegoreymendez\">@diegoreymendez</a>, <a href=\"https://github.com/frosty\">@frosty</a>, <a href=\"https://github.com/jleandroperez\">@jleandroperez</a>, <a href=\"https://github.com/koke\">@koke</a>, <a href=\"https://github.com/kurzee\">@kurzee</a>, <a href=\"https://github.com/kwonye\">@kwonye</a>, <a href=\"https://github.com/sendhil\">@sendhil</a> and <a href=\"https://github.com/SergioEstevao\">@SergioEstevao</a>.</p>\n<p>You can track the development progress for the next update by visiting <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?utf8=✓&q=is%3Aissue+milestone%3A6.2+\" target=\"_blank\">our 6.2 milestone on GitHub</a>. Until next time!</p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3375&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 25 Apr 2016 13:30:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"diegoreymendez\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Post Status: WordPress Development Tools — Draft Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=24094\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://poststatus.com/wordpress-development-tools-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5423:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and Brian Krogsgard.</p>\n<p><span>Everybody creates workflows to accomplish their development work. And sometimes you come upon a new tool that completely changes how you do things, and helps you improve your productivity.</span></p>\n<p><span>In this episode, Joe and Brian aim to share their tools in the hopes that it will help others review and refine their own processes. And Joe and Brian approach things quite differently themselves, so they compare and contrast their own workflows. Have something to add to the conversation, be sure to comment!</span></p>\n<!--[if lt IE 9]><script>document.createElement(\'audio\');</script><![endif]-->\n<a href=\"https://audio.simplecast.com/36197.mp3\">https://audio.simplecast.com/36197.mp3</a>\n<p><a href=\"http://audio.simplecast.com/36197.mp3\">Direct Download</a></p>\n<h3>Tools</h3>\n<ul>\n<li><a href=\"https://github.com/modmore/Gitify\">Gitify</a>, <a href=\"http://www.cockos.com/licecap/\">lice-cap</a></li>\n<li><a href=\"http://www.capturedapp.com/\">Captured (straight to S3)</a>, <a href=\"http://gifhub.org/\">Gifhub</a>, <a href=\"https://www.telestream.net/screenflow/\">Screenflow</a>, <a href=\"https://cloudup.com/\">Cloudup</a></li>\n<li><a href=\"https://www.authy.com/\">Authy</a></li>\n<li><a href=\"https://justgetflux.com/\">F.lux</a></li>\n<li><a href=\"https://www.tunnelbear.com/\">TunnelBear</a></li>\n<li><a href=\"https://www.alfredapp.com/\">Alfred</a></li>\n<li><a href=\"https://slack.com/\">Slack</a></li>\n</ul>\n<h3>Coding Tools &amp; Debugging</h3>\n<ul>\n<li><a href=\"https://www.jetbrains.com/phpstorm/\">PHPStorm</a>, <a href=\"https://www.sublimetext.com/\">Sublime</a>, <a href=\"https://atom.io/\">Atom</a>, <a href=\"http://www.vim.org/\">VIM</a>, <a href=\"https://panic.com/coda/\">Coda</a></li>\n<li><a href=\"https://xdebug.org/\">Xdebug</a>, <a href=\"http://php.net/manual/en/function.var-dump.php\">var_dump</a>, <a href=\"https://pecl.php.net/package/xhprof\">XHProf</a></li>\n<li><a href=\"https://github.com/jkbrzt/httpie\">httpie</a></li>\n<li><a href=\"https://atom.io/packages\">Atom Packages</a>: <a href=\"https://atom.io/packages/autocomplete-php\">php-autocomplete</a>, WPCS, <a href=\"https://atom.io/packages/linter-php\">php-linter</a></li>\n<li><a href=\"https://facebook.github.io/react/blog/2015/09/02/new-react-developer-tools.html\">React-console</a></li>\n<li><a href=\"https://wordpress.org/plugins/query-monitor/\">Query Monitor</a></li>\n<li><a href=\"http://www.sequelpro.com/\">Sequel Pro</a>, <a href=\"http://dev.mysql.com/doc/refman/5.7/en/mysql.html\">mysql command line</a></li>\n<li><a href=\"https://www.iterm2.com/\">iTerm2</a></li>\n<li><a href=\"http://wp-cli.org/\">wp-cli!!!</a></li>\n</ul>\n<h3>Build Tools</h3>\n<ul>\n<li><a href=\"http://gruntjs.com/\">Grunt</a></li>\n<li><a href=\"http://gulpjs.com/\">Gulp</a></li>\n<li><a href=\"https://www.gnu.org/software/make/\">Make</a></li>\n<li><a href=\"https://imageoptim.com/mac\">ImageOptim</a></li>\n<li><a href=\"https://www.npmjs.com/package/grunt-sass\">Grunt-sass</a> vs. <a href=\"https://www.npmjs.com/package/grunt-contrib-sass\">grunt-contrib-sass</a></li>\n</ul>\n<h3>Version Control / Review Tools / Deployment</h3>\n<ul>\n<li><a href=\"http://jonas.nitro.dk/tig/\">Tig</a>, <a href=\"https://www.git-tower.com/\">Tower</a></li>\n<li><a href=\"https://hub.github.com/\">Hub</a></li>\n<li><a href=\"https://github.com/\">Github</a></li>\n<li><a href=\"http://www.araxis.com/merge/index.en\">Araxis Merge</a></li>\n<li><a href=\"http://deploybot.com/\">DeployBot</a> / <a href=\"http://beanstalkapp.com/\">Beanstalk</a></li>\n<li><a href=\"https://panic.com/transmit/\">Transmit (S3/SFTP)</a></li>\n</ul>\n<h3>Frontend Tools / Extensions</h3>\n<ul>\n<li><a href=\"https://developer.chrome.com/devtools\">Chrome Inspector / Console</a></li>\n<li><a href=\"https://www.getpostman.com/\">Postman</a></li>\n<li><a href=\"https://developer.chrome.com/devtools/docs/javascript-debugging\">Chrome JS Debugger</a></li>\n<li><a href=\"https://chrome.google.com/webstore/detail/ip-address-and-domain-inf/lhgkegeccnckoiliokondpaaalbhafoa?hl=en\">IP &amp; Domain Info extension</a></li>\n<li><a href=\"https://chrome.google.com/webstore/detail/web-developer/bfbameneiokkgbdmiekhjnmfkcnldhhm?hl=en\">Web Developer</a></li>\n<li><a href=\"https://wappalyzer.com/\">Wappalyzer</a></li>\n<li><a href=\"http://codepen.io/\">CodePen</a></li>\n</ul>\n<h3>Sponsor</h3>\n<p class=\"p1\"><span class=\"s1\">This podcast is sponsored by <a href=\"https://yoast.com/\">Yoast</a>. Yoast SEO is the best WordPress SEO plugin available, with a premium version to provide expert support and additional features. Thank you to Yoast for being a Post Status partner.</span></p>\n<h3>Related Podcasts</h3>\n<p><a href=\"https://poststatus.com/understanding-wp-cli-and-a-discussion-on-micro-plugin-businesses-draft-podcast/\">Understanding WP-CLI</a></p>\n<p><a href=\"https://poststatus.com/local-wordpress-development-strategies-and-transparency-in-business-draft-podcast/\">Local WordPress Development Strategies</a></p>\n<p>&nbsp;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 23 Apr 2016 14:06:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"WPTavern: In Case You Missed It – Issue 8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=53989&preview_id=53989\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://wptavern.com/in-case-you-missed-it-issue-8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5006:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png\" rel=\"attachment wp-att-50955\"><img class=\"size-full wp-image-50955\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png?resize=676%2C292\" alt=\"In Case You Missed It Featured Image\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/112901923@N07/16153818039\">Night Moves</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc/2.0/\">(license)</a>\n<p>There’s a lot of great WordPress content published in the community but not all of it is featured on the Tavern. This post is an assortment of items related to WordPress that caught my eye but didn’t make it into a full post.</p>\n<h2>Matt Mullenweg&#8217;s Father Passes Away</h2>\n<p>Losing a loved one is tough, especially when it&#8217;s a parent. Matt Mullenweg&#8217;s father, Chuck Mullenweg, recently passed away. Matt <a href=\"https://ma.tt/2016/04/in-memoriam-chuck-mullenweg/\">published a touching tribute</a> on his site that describes the kind of man his father was.</p>\n<blockquote><p>We were in a father / son bowling league. I remember admiring his work ethic so much: he’d get up before dawn every morning and put on a suit, grab his briefcase, and go to work. He often went in on weekends and I loved to go with him because they had &#8216;fast&#8217; internet at the office and I could read Dilbert and about Babylon 5. He was a voracious reader and learner, and loved tinkering whether it was cars or networking. In the other room I can hear a bitcoin mining rig he set up a few years ago. He was independent minded and unafraid to question the status quo.</p></blockquote>\n<p>My deepest sympathies and condolences go out to the Mullenweg family. You can read <a href=\"http://ma.tt/chuck/\">Chuck&#8217;s obituary here</a>.</p>\n<h2>My First Plugin</h2>\n<p>Thanks to <a href=\"https://profiles.wordpress.org/binarygary/\">Binarygary,</a> my first plugin is in the directory. It&#8217;s called <a href=\"https://wordpress.org/plugins/hello-admin/\">Hello Admin</a> and with each page load, a lyric from Hello Dolly displays as an admin notice.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/HelloAdminScreenshot.png\"><img class=\"size-full wp-image-54005\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/HelloAdminScreenshot.png?resize=706%2C390\" alt=\"Hello Admin in Action\" /></a>Hello Admin in Action\n<p>In all seriousness, the plugin is a joke and a humorous way to bring attention to developers <a href=\"http://wptavern.com/please-stop-abusing-wordpress-admin-notices\">abusing admin notices</a> in WordPress.</p>\n<h2>Pressware Partners with Evermore</h2>\n<p>Tom McFarlin <a href=\"https://tommcfarlin.com/evermore/\">announced that his</a> company Pressware, is partnering with <a href=\"https://evermo.re/\">Evermore</a>. The partnership allows Pressware to provide its expertise in custom WordPress development and project management to Evermore&#8217;s customers.</p>\n<h2>Four Years of EDD</h2>\n<p>Pippin Williamson <a href=\"https://pippinsplugins.com/edd-4-years/\">shared the hardships and successes</a> he&#8217;s experienced in the last four years managing Easy Digital Downloads.</p>\n<blockquote><p>Today, Easy Digital Downloads is installed on over 50,000 websites, has reached nearly one million downloads, and has grown to a sustainable business that supports the livelihood of an ever-growing team comprised of full time employees and active contractors. I don’t think I ever thought we would be where we are today four years ago.</p></blockquote>\n<p>His post is an honest look at the amount of effort and circumstances beyond revenue that&#8217;s involved with running a successful business.</p>\n<h2>Translation Day Wapuu Posters!</h2>\n<p>In what is a traditional part of this series, I end each issue by featuring a Wapuu design. For those who don&#8217;t know, Wapuu is the <a href=\"http://wapuu.jp/2015/12/12/wapuu-origins/\">unofficial mascot</a> of the WordPress project. The first <a href=\"http://wptavern.com/wordpress-global-translation-day-set-for-april-24-2016\">global translation day</a> takes place on April 24th and to celebrate the occasion, the WordPress Polyglots team has created a series of Wapuu posters.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">New <a href=\"https://twitter.com/hashtag/WPTranslationDay?src=hash\">#WPTranslationDay</a> posters starring <a href=\"https://twitter.com/wp_wapuu\">@wp_wapuu</a> thanks to <a href=\"https://twitter.com/sonjaleix\">@sonjaleix</a>! Grab them while they’re hot! <a href=\"https://t.co/BfU9g8nG9S\">pic.twitter.com/BfU9g8nG9S</a></p>\n<p>&mdash; WPPolyglots (@TranslateWP) <a href=\"https://twitter.com/TranslateWP/status/723494729892110336\">April 22, 2016</a></p></blockquote>\n<p></p>\n<p>That&#8217;s it for issue eight. If you recently discovered a cool resource or post related to WordPress, please share it with us in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 23 Apr 2016 02:04:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"WPTavern: Facebook News Feed Now Favors Articles That Users Spend a Longer Time Reading\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53919\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"http://wptavern.com/facebook-news-feed-now-favors-articles-that-users-spend-a-longer-time-reading\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3187:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/reading.jpg\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/reading.jpg?resize=960%2C624\" alt=\"RC Cipriano\" class=\"size-full wp-image-53999\" /></a><a href=\"https://stocksnap.io/photo/F55691D3FB\">RC Cipriano</a>\n<p>Facebook <a href=\"https://newsroom.fb.com/news/2016/04/news-feed-fyi-more-articles-you-want-to-spend-time-viewing/\" target=\"_blank\">announced</a> yesterday that its news feed algorithm will now favor articles that users spend a long time reading. While likes, clicks, comments, and sharing counts are all valuable metrics, they are not always reliable determinants for what users want to see. Facebook discovered this by gathering feedback via its Feed Quality Program.</p>\n<p>As a result, the social network <a href=\"https://newsroom.fb.com/news/2015/06/news-feed-fyi-taking-into-account-time-spent-on-stories/\" target=\"_blank\">updated its algorithm last June</a> to factor in how much time users spent reading posts within the news feed, regardless of whether users even opened the article. <a href=\"https://newsroom.fb.com/news/2014/08/news-feed-fyi-click-baiting/\" target=\"_blank\">Two years ago</a>, Facebook also began factoring in instances where a user clicks on an article but then comes straight back to the news feed. This could be because a site loaded too slowly or the article was click-bait and not what the user was expecting based on the preview.</p>\n<p>&#8220;Building on this work, we’re learning that the time people choose to spend reading or watching content they clicked on from News Feed is an important signal that the story was interesting to them,&#8221; Facebook representatives said.<strong> &#8220;We are adding another factor to News Feed ranking so that we will now predict how long you spend looking at an article in the Facebook mobile browser or an Instant Article after you have clicked through from News Feed.&#8221;</strong></p>\n<p>Facebook will not be counting loading time towards this new ranking signal but will calculate the actual time spent reading/watching once the content has loaded. But before you think you can game this algorithm by simply publishing longer articles, Facebook will be measuring this time as a threshold so that longer articles are not preferred by default.</p>\n<p>The social network also announced that it will be diversifying its display of posts from different pages so as not to bombard users with too much content from the same source.</p>\n<p>&#8220;We’ve also heard from people that they enjoy reading articles from a wide range of publishers, and it can be repetitive if too many articles from the same source are back to back in their News Feed,&#8221; representatives said. &#8220;We’ll also be making an update to reduce how often people see several posts in a row from the same source in their News Feed.&#8221;</p>\n<p>Publishers who depend on Facebook for a significant amount of their referrals will want to take note of these changes to the news feed algorithm. The social network has already started rolling them out and will continue over the next few weeks.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Apr 2016 22:21:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: What WordPress.org Does with the Data it Collects from Users Sites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53940\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"http://wptavern.com/what-wordpress-org-does-with-the-data-it-collects-from-users-sites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5110:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/12/FreemiusFeaturedImage.png\"><img class=\"size-full wp-image-49261\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/12/FreemiusFeaturedImage.png?resize=660%2C291\" alt=\"Freemius Featured Image\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/29096601@N00/2920562020\">data slide</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc/2.0/\">(license)</a>\n<p>Since I started covering WordPress in 2009, one of the things I&#8217;ve noticed is that certain topics have a cyclical nature to them. One of these <a href=\"http://wptavern.com/phoning-home-to-plugin-authors\">is the contention in the WordPress community</a> on what data is <a href=\"http://interconnectit.com/1722/who-is-wordpress-talking-to/\">sent, stored, and shared</a> on WordPress.org. In a <a href=\"http://torquemag.io/2016/04/user-data-wordpress-org-belong-community/\">post published</a> on Torquemag.io, Josh Pollock, Founder of <a href=\"https://calderawp.com/\">CalderaWP</a>, argues that WordPress is a community-driven project and as such, data collected by WordPress.org should be shared with the community.</p>\n<blockquote><p>If installing and updating themes via the WordPress dashboard wasn’t so easy, WordPress wouldn’t be what it is today. I understand and appreciate this.</p>\n<p>Here’s the part that doesn’t sit well with me: WordPress.org is collecting data on all of its users (as it should), but this information isn’t available in aggregate form to the community.</p></blockquote>\n<p>Pollock says that as an entrepreneur, the information would help him make informed business decisions.</p>\n<h2>Data is Stored for Two Days</h2>\n<p>I spoke to Samuel ‘Otto’ Wood, who helps maintain WordPress.org, and discovered that some of the assumptions people have are not true.</p>\n<p>&#8220;The data collection systems on <a href=\"http://w.org/\" target=\"_blank\" rel=\"noreferrer\">w.org</a> have been inconsistent at best, and re-written several times,&#8221; Wood said.</p>\n<p>&#8220;But the general idea that there is some kind of treasure trove of information we&#8217;re storing is misguided, at best. The data is collected, aggregated for the things we display, then tossed. We don&#8217;t store it for any serious length of time. Just the results of the data like the counts.&#8221;</p>\n<p>Gathering, sorting, and displaying the large amount of data associated with WordPress is a CPU intensive job. The most recent example of WordPress.org sharing aggregate data is for active installs of <a href=\"http://wptavern.com/wordpress-plugin-directory-launches-new-design\">plugins</a> and <a href=\"http://wptavern.com/the-wordpress-theme-directory-replaces-download-counts-with-the-number-of-active-installs\">themes</a>. Displaying the Active Install count is the result of significant performance improvements from WordPress lead developer <a href=\"http://wptavern.com/the-wordpress-theme-directory-replaces-download-counts-with-the-number-of-active-installs\">Dion Hulse</a>. Without the improvements, the data collection would have overloaded CPUs and MySQL databases.</p>\n<p>&#8220;Gathering that data is frickin&#8217; difficult to start with, &#8220;Wood said. &#8220;For the longest time, we didn&#8217;t even have the actual system resources to pull off the &#8216;Active Installs&#8217; count. We didn&#8217;t display that count because <b>we couldn&#8217;t do it</b>. The idea that we&#8217;re hiding things is ludicrous.&#8221;</p>\n<p>Raw data is stored for two days and is then overwritten, &#8220;basically, there&#8217;s too much data to store,&#8221; Wood said. &#8220;All of the data that <a href=\"http://w.org/\" target=\"_blank\" rel=\"noreferrer\">w.org</a> gathers is used to display the stats on <a href=\"http://w.org/\" target=\"_blank\" rel=\"noreferrer\">w.org</a> itself. Nothing special is hidden.&#8221;</p>\n<h2>Data Accuracy is Hard</h2>\n<p>If developers are going to make business decisions using public data, the data has to be accurate. Accuracy is a complex problem but the team has slowly made progress over the years as legacy systems on W.org are phased out.</p>\n<p>&#8220;A lot of the <a href=\"http://w.org/\" target=\"_blank\" rel=\"noreferrer\">w.org</a> systems are poorly made,&#8221; Wood said. &#8220;They&#8217;re old, have been modified dozens of times over the years, and badly in need of updating. For a long time, the data we gathered could not be processed fast enough so we simply threw over half of it away.</p>\n<p>&#8220;Mostly, we phase out old useless systems and replace them with something better and newer which gives us things to display. Active Install counts was an entirely new system that replaced an older one which didn&#8217;t give any useful information.&#8221;</p>\n<p>Wood confirms what I&#8217;ve believed to be true for a long time. WordPress.org is not storing data for an extended period of time and the information that is collected is likely on public display somewhere on the site. What types of data would you like to see on WordPress.org?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Apr 2016 20:38:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"WPTavern: Guggenheim.org Relaunches on WordPress Using the WP REST API\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53954\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"http://wptavern.com/guggenheim-org-relaunches-on-wordpress-using-the-wp-rest-api\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2726:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/guggenheim.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/guggenheim.png?resize=1025%2C444\" alt=\"guggenheim\" class=\"aligncenter size-full wp-image-53969\" /></a></p>\n<p>The <a href=\"http://www.guggenheim.org/\" target=\"_blank\">Guggenheim</a> relaunched its website on WordPress this week. The site, which represents the collection of Guggenheim museums, was in need of an overhaul that would modernize its underlying architecture and design.</p>\n<p>Laura Kleger, who oversees the foundation&#8217;s online projects, explained why the Guggenheim chose WordPress for its new website. She said that the team began with a CMS analysis phase, which included Drupal and WordPress.</p>\n<p>&#8220;The ideal process for improving websites is incremental and rapid change, but the old Guggenheim.org had accumulated too much technical and structural debt to produce further results, and a big leap forward was required,&#8221; Kleger said.</p>\n<p>Prior to embarking on the project, the Guggenheim was running on Joomla, but the team had a difficult time implementing small changes.</p>\n<p>&#8220;We wanted to use a widely adopted, open-source CMS with enough muscle to meet advanced needs,&#8221; Kleger said. They needed a user-friendly way for museum staff to create and update content without requesting the help of of designers and developers for simple updates.</p>\n<p>&#8220;We chose WordPress for a few reasons &#8211; among them, the broad pool of developer resources, the excellence of the content administration interface, the rapid update release cycle, the ease of extending functionality, and the CMS’s deep taxonomy,&#8221; Kleger said.</p>\n<p>The Guggenheim partnered with New York-based development agency <a href=\"https://www.alleyinteractive.com/\" target=\"_blank\">Alley Interactive</a> for the website&#8217;s overhaul, who recommended implementing a headless version of WordPress with content served via the WP REST API. This allowed the team to build out the frontend of the site using AngularJS.</p>\n<p>&#8220;As noted by <a href=\"http://alistapart.com/column/nearly-headless-cms\" target=\"_blank\">others</a>, this approach is superior to the standard WordPress templating approach for achieving some of the more exciting possibilities in user experience today,&#8221; Kleger said.</p>\n<p>The new website is a beautiful example of the WP REST API in the wild. For a deeper look at the design and development process, check out Kleger&#8217;s <a href=\"http://www.guggenheim.org/blogs/checklist/meet-the-new-guggenheim-org\" target=\"_blank\">post announcing the new Guggenheim.org</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Apr 2016 13:34:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WPTavern: WordPress 4.5.1 Expected Early Next Week\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53935\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"http://wptavern.com/wordpress-4-5-1-expected-early-next-week\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1567:\"<p>WordPress 4.5 &#8220;Coleman&#8221; was <a href=\"http://wptavern.com/wordpress-4-5-coleman-released-introduces-custom-logos-responsive-previews-improved-editing-experience\">released last week</a> without too many issues. However, the WordPress development team recently identified two bugs that are prompting an immediate point release <a href=\"https://make.wordpress.org/core/2016/04/20/4-5-1-release-candidate-tomorrow-april-21st/\">scheduled for next week</a>.</p>\n<p>The <a href=\"https://core.trac.wordpress.org/ticket/36545\">first is that</a> TinyMCE toolbars and tabs are unresponsive in Chrome Version 50.0.2661.75 beta-m (64-bit). The second is that <a href=\"https://core.trac.wordpress.org/ticket/36510\">page templates with widgets are styled incorrectly</a>. WordPress 4.5 added a singular class that many themes use, including Twenty Eleven, that breaks a site&#8217;s layout. After a lengthy discussion and testing, the decision was to <a href=\"https://core.trac.wordpress.org/changeset/36112\">revert</a> the change.</p>\n<p><a href=\"https://wordpress.org/wordpress-4.5.1-RC2.zip\">WordPress 4.5.1 RC 1</a> is available and the core team wants as many people as possible to test the <a href=\"https://make.wordpress.org/core/2016/04/22/4-5-1-release-candidate/\">TinyMCE update and other bug fixes</a> included in the release. If you think you&#8217;ve discovered a bug, you&#8217;re encouraged to report it in the <a href=\"https://wordpress.org/support/forum/alphabeta\">Alpha/Beta section</a> of the support forums.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Apr 2016 02:17:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"WPTavern: Jetpack 4.0 Released with UI Improvements and New Editor View for VideoPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53910\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"http://wptavern.com/jetpack-4-0-released-with-ui-improvements-and-new-editor-view-for-videopress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2915:\"<p>Shortly after Jetpack 4.0 was released yesterday many <a href=\"https://wordpress.org/support/topic/fatal-error-when-updating-to-jetpack-40-read-this\" target=\"_blank\">users reported a fatal error and/or white screen when updating</a>. Developers started <a href=\"https://www.facebook.com/groups/168889943173228?view=permalink&id=1141144765947736\" target=\"_blank\">warning each other in the Advanced WordPress Facebook group to avoid updating to 4.0</a>, after having received emails from clients with sites that went down. A followup 4.0.2 release was pushed out today for users with the specific configuration that caused the fatal error.</p>\n<p>This is the third time in under two months that the Jetpack team has had to send out a followup update on the heels of a release to correct significant problems. Fortunately, the team worked quickly to get a fix out to sites with fatal errors.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/jetpack-ui-improvements.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/jetpack-ui-improvements.png?resize=286%2C300\" alt=\"jetpack-ui-improvements\" class=\"alignright size-medium wp-image-53926\" /></a>The 4.0 milestone brings major UI improvements for on-boarding new users. In previous versions of the plugin, visiting the Jetpack settings page showed a big green button prompting users to connect to WordPress.com.</p>\n<p>This release introduces a full page explaining the benefits of Jetpack to encourage users to hook it up. It also displays a picture of the development and support team, an explanation of Photon, and the benefits of the Protect module.</p>\n<p>Version 4.0 also adds a new editor view for VideoPress that lets users edit the shortcode in the editor with a new modal options window. This makes it easy to wrangle VideoPress settings directly in the editor</p>\n<p>A few other notable enhancements in this release include:</p>\n<ul>\n<li>Tighter WooCommerce Integration: Social sharing icons now appear on WooCommerce single product views</li>\n<li>Widget Visibility for Custom Post Type Archives: Show/hide widgets for CPT single or archive views</li>\n<li>Selective Refresh for Widgets: Widgets now update instantly with live previews in the customizer</li>\n<li>Updated schema.org Microdata for Breadcrumbs: Gives search engines a better understanding of a page&#8217;s position in the site hierarchy</li>\n</ul>\n<p>Jetpack 4.0 also adds performance enhancements for the Protect module and Contact Forms. The method it uses to clean the database of spam form submission records is now more efficient. Check out the <a href=\"https://wordpress.org/plugins/jetpack/changelog/\" target=\"_blank\">changelog</a> to see a full list of all the enhancements and fixes in this release. It should be safe to update your sites and clients&#8217; sites to 4.0.2 without any ill effects.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Apr 2016 21:46:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"WPTavern: WPWeekly Episode 231 – An Inside Look at the Plugin Review Process with Mika Epstein\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=53924&preview_id=53924\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"http://wptavern.com/wpweekly-episode-231-an-inside-look-at-the-plugin-review-process-with-mika-epstein\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2951:\"<p>In this episode of WordPress Weekly, <a href=\"https://discord.gg/0wOgTCREXzBiWNYG\">Marcus Couch</a> and I are joined by <a href=\"https://halfelf.org/\">Mika Epstein</a>. Epstein reviews plugins before they&#8217;re added to the WordPress plugin directory and volunteers on the WordPress support forums. We learn what the plugin review process is like and common security issues she discovers. I was shocked to learn that Epstein has experienced some of the worst in people from denying plugins into the directory.</p>\n<p>We discuss the idea of a WordPress notifications center and how it could help keep users aware of issues on their sites. Last but not least, she gives us a heads up on common issues that have been reported on the support forums since the release of WordPress 4.5.</p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/ask-me-anything-anonymously/\">Ask Me Anything (Anonymously), </a>by <a href=\"https://profiles.wordpress.org/arunbasillal/\">Arun Basil Lal</a> from India, enables users to easily add a page or widget using a shortcode where visitors can ask you questions anonymously and you can list them along with your answers.</p>\n<p><a href=\"https://wordpress.org/plugins/admin-cleanup/\">Admin Cleanup, </a>by <a href=\"https://profiles.wordpress.org/mgibbs189/\">Matt Gibbs </a>from Charlottesville, VA, lets you hide menu items (e.g. Tools) entirely, or move them into the WordPress Admin Bar.</p>\n<p><a href=\"https://wordpress.org/plugins/logic-shortcodes/\">Logic Shortcodes, </a>by <a href=\"https://profiles.wordpress.org/samueldiethelm/\">Samuel Diethelm</a> from Marbella, Spain, enables the use of [if] shortcodes to work with conditional logic based on post meta or taxonomy terms on posts and pages. With conditional logic for taxonomy terms, you can use names, slugs or term_ids. For example: [if taxonomy=&#8221;category&#8221; slug=&#8221;cars&#8221;]Content to show[/if]</p>\n<p><a href=\"https://wordpress.org/plugins/dispensary-coupons/\">Dispensary Coupons<b>, </b></a>by <a href=\"https://profiles.wordpress.org/deviodigital/\">Robert DeVore </a>from Michigan, allows you to prominently display discounts on flower, tinctures, edibles and more with a simple shortcode or widget.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, April 27th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #231:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Apr 2016 19:15:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: Beaver Builder Passes $1 Million in Revenue After 2 Years in Business\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53893\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"http://wptavern.com/beaver-builder-passes-1-million-in-revenue-after-2-years-in-business\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2778:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/beaver-builder.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/beaver-builder.png?resize=1025%2C432\" alt=\"beaver-builder\" class=\"aligncenter size-full wp-image-53906\" /></a></p>\n<p>Beaver Builder, the drag-and-drop page builder plugin, <a href=\"https://www.wpbeaverbuilder.com/2nd-birthday-big-milestone-april-update/\" target=\"_blank\">celebrated two years in business</a> this week. Fastline Media, the parent company, started as a web design agency, but due to the success of their product the team closed down its client services department at the beginning of 2016 to focus 100% on Beaver Builder. After just two years in business, the plugin has passed $1 million in revenue.</p>\n<p>Beaver Builder hired its first employee in April, 2015, a year after launching. It now employees four people full-time and a few part-time contractors in addition to its three founders. The plugin recently passed 100,000 active installations between the <a href=\"https://wordpress.org/plugins/beaver-builder-lite-version/\" target=\"_blank\">WordPress.org</a> and commercial versions.</p>\n<p>As part of their two year milestone post, the team also announced that it acquired the beaverbuilder.com domain name, which set them back $2,300, according to co-founder Robby McCullough.</p>\n<p>&#8220;There was a really good salesman for the holding company that we bought it through,&#8221; McCullough said. &#8220;He convinced me it was a steal. Considering it probably cost ~$10 originally, though, it was a bit of a sting.&#8221;</p>\n<p>McCullough said that he and his co-founders see Beaver Builder, and other WordPress website builders, as being a bridge between WordPress and its mainstream market competitors like Wix and Weebly.</p>\n<p>&#8220;This idea came up during Jeff King&#8217;s presentation at Pressnomics, as more and more traditional &#8216;jobs&#8217; become automated and obsolete (think driverless cars/trucks on the horizon),&#8221; McCullough said. &#8220;More and more people will be forced to start small businesses and create their own opportunities. Along with democratizing publishing, we think WordPress (and the web in general) — hopefully with the help of Beaver Builder — has the opportunity to &#8216;democratize the workforce.\'&#8221;</p>\n<p>With the $1 million milestone under their belts, McCullough said the Beaver Builder co-founders plan to keep putting food on the table and taking care of customers.</p>\n<p>&#8220;We&#8217;ve made it this far by providing great support and embracing customer feedback,&#8221; McCullough said. &#8220;We might be in the driver seat, but our customers are the ones laying the track.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Apr 2016 18:03:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WP Mobile Apps: WordPress for iOS: Call for beta testers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.com/?p=3397\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://apps.wordpress.com/2016/04/21/wordpress-for-ios-call-for-beta-testers/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:769:\"<p>Hello, WordPress users! We are launching a shiny, new TestFlight beta testing program for WordPress for iOS. If you yearn for the latest features, enjoy breaking things, and don&#8217;t mind uncovering a bug or two in the process, we need you!</p>\n<p>Please <a href=\"https://docs.google.com/forms/d/1n0sD8O_Upb9h5FvKj6z_MFWPH5valmpQgbZf5kQEejU/viewform\">fill out our signup form</a> to request to join as a beta tester. If there are available spaces in the beta program, you will receive an email from TestFlight with instructions to download the latest beta release. We can&#8217;t wait to hear your feedback!</p>\n<img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3397&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Apr 2016 12:35:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Rachel\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"Matt: In Memoriam: Chuck Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46426\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://ma.tt/2016/04/in-memoriam-chuck-mullenweg/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5678:\"<p><img class=\"alignnone size-full wp-image-46437\" src=\"http://i2.wp.com/ma.tt/files/2016/04/MCM_5265-1-1.jpg?resize=604%2C302&ssl=1\" alt=\"MCM_5265 (1).JPG\" /></p>\n<p>My father, Chuck Mullenweg, passed one week ago today. After over a month in ICU he had just been transferred to long-term acute care in a different hospital and we were looking forward to a tough but steady road to being back home when he took an unexpected and sudden turn. I&#8217;ve started and stopped writing this dozens of times since then and words continue to fail me.</p>\n<p>Here&#8217;s the rememberance that ran in the paper a few days ago:</p>\n<p><a href=\"http://i0.wp.com/ma.tt/files/2016/04/W01521910pdfpreview.png\"><img class=\"aligncenter wp-image-46424 size-medium\" src=\"http://i0.wp.com/ma.tt/files/2016/04/W01521910pdfpreview.png?resize=604%2C296\" alt=\"\" /></a></p>\n<p><img class=\"  wp-image-46500 alignright\" src=\"http://i2.wp.com/ma.tt/files/2016/04/IMG_6024.jpg?resize=262%2C333&ssl=1\" alt=\"IMG_6024.JPG\" />It is impossible to overstate the influence my father has had on every part of my life: Why did I play saxophone? Dad did. Computers and programming? Dad did. Travel? He was frequently stationed overseas and even when we didn&#8217;t visit he would always bring back a cool gift for myself and my sister. He drove me to the HAL-PC office (local non-profit) every weekend where I&#8217;d learn so much fixing people&#8217;s broken computers and being exposed to open source for the first time. His O&#8217;Reilly &#8220;camel book&#8221; on Perl was the first scripting I learned, and he pointed me toward Mastering Regular Expressions which became the basis of <a href=\"https://ma.tt/2002/09/smart-quotes-in-php/\">my first contribution to b2, texturize</a>.</p>\n<p>We were in a father / son bowling league. I remember admiring his work ethic so much: he&#8217;d get up before dawn every morning and put on a suit, grab his briefcase, and go to work. He often went in on weekends and I loved to go with him because they had &#8220;fast&#8221; internet at the office and I could read Dilbert and about Babylon 5. He was a voracious reader and learner, and loved tinkering whether it was cars or networking. In the other room I can hear a bitcoin mining rig he set up a few years ago. He was independent minded and unafraid to question the status quo.</p>\n<p><img class=\"aligncenter size-full wp-image-46504\" src=\"http://i1.wp.com/ma.tt/files/2016/04/IMG_4385.jpg?resize=351%2C263&ssl=1\" alt=\"IMG_4385.JPG\" /></p>\n<p>There&#8217;s a photo somewhere of my dad mowing the lawn and me following behind him with a toy lawnmower, which is a perfect metaphor for how I&#8217;ve always followed in his footsteps.</p>\n<p><img class=\"alignnone size-full wp-image-46511\" src=\"http://i1.wp.com/ma.tt/files/2016/04/MCM_5113.jpg?resize=604%2C238&ssl=1\" alt=\"MCM_5113.jpg\" /></p>\n<p>I&#8217;m at a loss.</p>\n<p>Parents are there literally the day you&#8217;re born, and it&#8217;s hard to imagine a life without them. Most people reading this will outlive their parents, and deal with their mortality and often difficult and painful final days as those who brought us into this world exit it. I&#8217;ve been reading and reading all the writing I can find on this topic, but nothing really prepares you for it, and nothing makes it better to go through. It&#8217;s terrible.</p>\n<p><img class=\"alignnone size-full wp-image-46508\" src=\"http://i2.wp.com/ma.tt/files/2016/04/MCM_7807.jpg?resize=604%2C402&ssl=1\" alt=\"MCM_7807.jpg\" /></p>\n<p>He wasn&#8217;t someone to tell you what the right way to live was, in fact he was incredibly open minded. He didn&#8217;t tell you, he showed you how he lived his life from a place of integrity and trust, how he was in his relationship with my mom, how he was in business. He wasn&#8217;t flashy and seldom talked about his accomplishments or all the people he had helped out along the way. Many of the stories of appreciation coming in I&#8217;m hearing for the first time. In getting his books and taxes together this past week I was humbled by how simply he lived this season of his life, not into material things but cherishing relationships and his quiet life in the suburbs with my mother.</p>\n<p><img class=\"alignnone size-full wp-image-46499\" src=\"http://i1.wp.com/ma.tt/files/2016/04/IMG_20151225_160835-1.jpg?resize=604%2C452&ssl=1\" alt=\"IMG_20151225_160835 (1).jpg\" /></p>\n<p>My biggest blessing has been my family. Every one is the most supportive you can imagine. So inspiring&#8230; much of what I&#8217;ve done in the world was in the context of making my parents proud, and their relationship to each other and the amazing man my dad was has set a bar I hope to approach in my lifetime. The last few years he got much better about showing his pride in my sister and I, and even more importantly saying &#8220;I love you,&#8221; the three words that are among the best gift we can give each other. Don&#8217;t forget to use them, even if it feels cheesy or embarrassing, and for those of you with parents still around please give them some <a href=\"http://waitbutwhy.com/2015/12/the-tail-end.html\">extra time</a> and a hug for me. This was unexpected, we really believed he was on an upward trajectory. You never know when the words you share with someone might be the last.</p>\n<p><img class=\"alignnone size-full wp-image-46506\" src=\"http://i1.wp.com/ma.tt/files/2016/04/MCM_5139.jpg?resize=604%2C402&ssl=1\" alt=\"MCM_5139.JPG\" /></p>\n<p>I made a page <a href=\"http://ma.tt/chuck/\">you can see his official obituary, information about his memorial service in Katy, and leave any memories you have of him at ma.tt/chuck</a>.</p>\n<p>&nbsp;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Apr 2016 06:58:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"WPTavern: A Tip for Convincing Customers to Renew License Keys\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53881\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"http://wptavern.com/a-tip-for-convincing-customers-to-renew-license-keys\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3583:\"<p>Mika Epstein, who helps review plugins before they&#8217;re added to the directory and is a dedicated support forum volunteer, <a href=\"https://halfelf.org/2016/despair-licensed-updates/\">has a great post</a> on the difficulties associated with plugins that require license keys for updates. She addresses topics like keeping users informed, ownership, and bundling plugins with themes. She also suggests the following solution to get users with an expired license key to renew.</p>\n<blockquote><p>What if the updater kept checking, license expired or not, and when you clicked to upgrade it alerted you?</p>\n<p>Your license for Foobar has expired. Please renew it in order to upgrade.</p>\n<p>What if you got this email?</p>\n<p>Hey, you bought Foobar back in 2014 and that license lapsed. Normally I’d never bother you, but today I’ve pushed a major security fix. Since this is a security release, I’m offering you a discount. It’s already applied to your account, just log in and you can buy the upgrade at 50% off. If you’re not using Foobar anymore, click here and I’ll have your account flagged so we don’t bother you about this again.</p>\n<p>How happy would you be to find out someone saved your soy bacon?</p></blockquote>\n<p>Based <a href=\"https://halfelf.org/2016/despair-licensed-updates/#comment-75676\">on the comments</a> of her article and from what Epstein has experienced from years of providing WordPress support, it&#8217;s a complex problem without a solution. The perils of updating commercial plugins bundled with themes that require a license key were apparent two years ago when a <a href=\"http://wptavern.com/critical-security-vulnerability-found-in-wordpress-slider-revolution-plugin-immediate-update-advised\">critical security vulnerability was discovered</a> in Revolution Slider.</p>\n<p>Had the news not been published across media outlets, many users may not have known about the update. In some cases, users couldn&#8217;t update because they didn&#8217;t have the required license key, <a href=\"http://wptavern.com/critical-security-vulnerability-found-in-wordpress-slider-revolution-plugin-immediate-update-advised#comment-58566\">as was the case with Brenda</a>.</p>\n<blockquote><p>The slider plugin was bundled in a theme that a PREVIOUS web developer installed for one of my clients. As such, I do not have the theme license key. There is NO WAY that I would ever have known about this extreme vulnerability had Sucuri not released it.</p></blockquote>\n<p>Some companies make security updates available to all customers regardless if their license is expired. For example, earlier this year, a <a href=\"http://wptavern.com/critical-security-vulnerability-discovered-in-elegant-themes-products\">critical security vulnerability was discovered</a> in Elegant Themes products. Due to the severity of the issue, the company made the updates available for free to expired accounts. The updates contained only the security fix without any of the new features developed in recent versions.</p>\n<p>There&#8217;s a delicate balance between pushing customers to upgrade, renew license keys, and making it easy to do so. As Epstein says in the conclusion of her post, &#8220;If you make it easy to pay, people will renew and pay. If you inform them of security issues, they will pay and upgrade.&#8221;</p>\n<p>If you&#8217;re a commercial plugin developer, how do you inform and convince customers to renew their license keys? Also, how do you handle security updates for customers with expired licenses?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Apr 2016 22:49:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: WP Dispensary Offers a Complete Marijuana Menu Solution for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53859\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"http://wptavern.com/wp-dispensary-offers-a-complete-marijuana-menu-solution-for-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4972:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/blueberry-kush.jpg\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/blueberry-kush.jpg?resize=1000%2C605\" alt=\"photo credit: Blueberry Kush, Indica-3 - (license)\" class=\"size-full wp-image-53861\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/57298467@N03/5500914557\">Blueberry Kush, Indica-3</a> &#8211; <a href=\"https://creativecommons.org/licenses/by/2.0/\">(license)</a>\n<p>With <a href=\"http://medicalmarijuana.procon.org/view.resource.php?resourceID=000881\" target=\"_blank\">24 states</a> having enacted laws to legalize medical marijuana, the industry is booming and dispensaries need websites. <a href=\"https://wordpress.org/plugins/wp-dispensary/\" target=\"_blank\">WP Dispensary</a>, released five months ago, is the first WordPress plugin to target this underserved market.</p>\n<p>After creating <a href=\"https://wordpress.org/plugins/leafly-reviews/\" target=\"_blank\">Leafly Reviews</a>, a plugin that displays dispensary reviews from Leafly using a widget or shortcode, <a href=\"http://www.robertdevore.com\" target=\"_blank\">Robert DeVore</a> decided he wanted to make more solutions to help dispensary owners build professional websites. <a href=\"https://wordpress.org/plugins/wp-dispensary/\" target=\"_blank\">WP Dispensary</a> and <a href=\"https://wordpress.org/plugins/dispensary-coupons/\" target=\"_blank\">Dispensary Coupons</a> soon followed on WordPress.org.</p>\n<p>Many marijuana dispensaries post their product menus on a board, printed on paper, or displayed on a tablet. The WP Dispensary plugin makes it easy to enter products, with all their relevant details, into a menu for display on a WordPress-powered website. This makes it easy for the dispensary owner to create, edit, and maintain a master list of products, which can also be displayed in the store.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/wpd-menu-update-1.4.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/wpd-menu-update-1.4.jpg?resize=160%2C174\" alt=\"wpd-menu-update-1.4\" class=\"alignright size-full wp-image-53872\" /></a>The plugin creates custom post types for flowers, edibles, concentrates, pre-rolls, and topicals. It also includes custom taxonomies for aromas, flavors, effects, symptoms, and conditions. This allows visitors to easily sort available products.</p>\n<p>Entering a new menu item is as easy as writing a post, so dispensary owners will have no problem keeping their menus updated:</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/add-flower.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/add-flower.png?resize=1025%2C489\" alt=\"add-flower\" class=\"aligncenter size-full wp-image-53885\" /></a></p>\n<p>Dispensary owners can also enter product prices for flowers and concentrates based on weight, from 1/2 gram to an ounce. Edibles and pre-rolls allow you to enter the THC and CBD percentages.</p>\n<p>Today&#8217;s <a href=\"http://www.wpdispensary.com/wp-dispensary-version-1-4/\" target=\"_blank\">version 1.4 release</a>, in honor of the 4/20 holiday, adds topicals to the existing custom post types, with extra product information options for unit price, unit size, and THC mg and CBD mg.</p>\n<p>When used in combination with DeVore&#8217;s free <a href=\"https://github.com/deviodigital/dispensary-display-wordpress-theme\" target=\"_blank\">Dispensary Display</a> theme, products are displayed beautifully on the frontend with images for each menu item. After updating it to be compatible with the 1.4 release, DeVore plans to get the theme ready for submission to the official WordPress theme directory.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/dispensary-items.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/dispensary-items.png?resize=887%2C524\" alt=\"dispensary-items\" class=\"alignright size-full wp-image-53878\" /></a></p>\n<p>WP Dispensary is also fully integrated with the WP REST API so developers can pull data from the custom post types and display it with JavaScript in a website or app. This currently requires the <a href=\"https://wordpress.org/plugins/rest-api/\" target=\"_blank\">REST API plugin version 2</a> until the API is officially merged into core.</p>\n<p>WP Dispensary is 100% open source and available for anyone to <a href=\"https://wordpress.org/plugins/wp-dispensary/\" target=\"_blank\">download for free from WordPress.org</a>. Full <a href=\"http://www.wpdispensary.com/documentation/\" target=\"_blank\">documentation</a> is available for the plugin on the WP Dispensary project website, which includes instructions for setting it up, information on add-ons, and additional plugin suggestions. The plugin is also <a href=\"https://github.com/deviodigital/wp-dispensary\" target=\"_blank\">available on GitHub</a> if you want to contribute bug fixes or improvements.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Apr 2016 20:09:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: The Quest For a Centralized WordPress Notifications Center\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53785\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"http://wptavern.com/the-quest-for-a-centralized-wordpress-notifications-center\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9813:\"<p>Based on the number of comments we received on <a href=\"http://wptavern.com/please-stop-abusing-wordpress-admin-notices\">WordPress admin notices</a> being abused, it&#8217;s clear that a number of you feel the same way I do. Thanks to the healthy discussion that took place, I learned several new things about admin notices I&#8217;d like to share with you.</p>\n<h2>Themes Do it Too</h2>\n<p>While the crux of the article focuses on plugins being the largest offender, the issue also applies to themes hosted in and outside of the WordPress theme directory. In one of the more extreme examples I discovered, earlier this year, <a href=\"https://reduxframework.com/e\">Redux Framework</a> added an admin notice that informed users of a new <a href=\"https://reduxframework.com/extension/ad-remover/\">commercial extension</a>.</p>\n<p>When users questioned <a href=\"https://github.com/reduxframework/redux-framework/issues/2801\">how to remove the notices</a>, Redux Framework developers responded by creating a commercial extension.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/ReduxFrameworkAdNotice.png\"><img class=\"size-full wp-image-53826\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/ReduxFrameworkAdNotice.png?resize=1025%2C47\" alt=\"Redux Framework Admin Notice\" /></a>Redux Framework Admin Notice\n<p>For $59 a year, the extension removes admin notices, ads from the options panel, and the dashboard news widget. Even though the notices and ads are only displayed when the framework&#8217;s dev mode is enabled, it seems like a ridiculous way to generate revenue.</p>\n<p>While researching for this article, I discovered that Dovy Paukstys, Co-Founder and lead developer of Redux Framework, is in the process of removing advertising from current and future admin notices. Paukstys provided the Tavern with the following statement:</p>\n<blockquote><p>As a fellow developer, I can see how frustrating an admin notice can be when used as an ad. To support the requests of the community, we will no longer use admin notices to advertise premium features. We will use admin notices for their intended purpose, to inform and educate our users.</p>\n<p>We hope that other frameworks, plugins, and products will follow suit.</p></blockquote>\n<h2>WP Notification Center</h2>\n<p>Inspired by our article, WPBeginner looks into whether or not <a href=\"http://www.wpbeginner.com/opinion/does-wordpress-need-a-notification-center-we-think-so-how-about-you/\">WordPress needs a notification center</a>. As it turns out, there are a couple of different plugins and projects in the works aiming to solve this problem.</p>\n<p>The <a href=\"https://wordpress.org/plugins/wp-notification-center/\">WP Notification Center</a> plugin, developed by Barry Kooij and Never5, adds a <a href=\"http://www.barrykooij.com/wordpress-notification-manager/\">notification center</a> to WordPress. This plugin moves admin notices to a central location freeing up valuable screen real-estate.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/WPNotificationCenter.png\"><img class=\"size-full wp-image-53828\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/WPNotificationCenter.png?resize=638%2C155\" alt=\"WP Notification Center\" /></a>WP Notification Center\n<p>When activated, a notifications area is added to the admin bar. This tells you the number of notices available and provides quick viewing access. The messages are also color coded to easily tell the difference between update and error messages.</p>\n<p>Links within the notice take you to the corresponding admin page to view more details. Unfortunately, you can&#8217;t dismiss notices from the admin toolbar without navigating to the links within them. According to Kooij, dismissing notices is a difficult problem to fix.</p>\n<blockquote><p>The admin notices are added in code so I can&#8217;t stop them from being added. That means I would need to store what notices are dismissed and check all added notices on every admin page load to filter out the ones that are dismissed.</p>\n<p>It&#8217;s the other way around from an ideal situation, where a notice would be added to the database and I can simply remove it when it&#8217;s dismissed.</p></blockquote>\n<p>As for the possibility of getting WP Notification Center into core, &#8220;I would love to write a patch for core that would set this up the right way,&#8221; Kooij said. &#8220;That would eventually involve deprecating and stop displaying notifications that are being added the old way.&#8221;</p>\n<p>If you&#8217;re interested in tackling this problem or would like to contribute to other facets of the project, you can find it <a href=\"https://github.com/barrykooij/wp-notification-center\">on GitHub</a> where issues and pull requests are welcomed.</p>\n<h2>WordPress Notifications API</h2>\n<p>During the WordPress Core developer chat <a href=\"https://make.wordpress.org/core/2016/01/13/core-dev-chat-notes-for-jan-13/\">back in January</a>, John Blackbourn proposed a Notifications API that would replace <code>wp_mail()</code> with an extensible API. The API could be hooked into by developers to send notifications via webhooks that would enable Slack and IM notifications. There would also be UI added so users and admins can choose which individual notifications and types to opt-in/out of.</p>\n<p>The API is not directly relevant to admin notices but it&#8217;s possible they could be connected in the future. Blackbourn plans to publish a detailed blog post outlining the idea in-depth within the next week or two.</p>\n<h2>Jetpack Notifications</h2>\n<p>Jetpack handles notifications via a module that adds an icon to the toolbar. Notifications include, Likes, Comments, Follows, and the ability to moderate and reply to comments.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/JetpackNotifications.png\"><img class=\"size-full wp-image-53846\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/JetpackNotifications.png?resize=406%2C422\" alt=\"Jetpack Notifications\" /></a>Jetpack Notifications\n<p>I use this notifications area all the time to moderate and respond to comments. It&#8217;s convenient and usually loads items quickly. However, I&#8217;m not sure how well the interface would work if admin notices from themes and plugins were added.</p>\n<h2>Subscribers Can Possibly See Admin Notices</h2>\n<p>One of the most surprising <a href=\"http://wptavern.com/please-stop-abusing-wordpress-admin-notices#comment-165057\">things I&#8217;ve learned</a> is that users who are subscribers can <em>possibly</em> see admin notices. On the surface, this doesn&#8217;t make sense as subscribers don&#8217;t have the capabilities necessary to act on notices. I tested this theory on the WP Tavern test site by activating both Yoast SEO and the All in One SEO plugin.</p>\n<p>This is what I see while logged in as an admin.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/AdminNoticesSEO.png\"><img class=\"size-full wp-image-53847\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/AdminNoticesSEO.png?resize=1025%2C293\" alt=\"Admin Notices While Logged in as Admin\" /></a>Admin Notices While Logged in as Admin\n<p>This is the same dashboard while logged in as a subscriber.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/AdminNoticesWhileASubscriber.png\"><img class=\"size-full wp-image-53848\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/AdminNoticesWhileASubscriber.png?resize=1025%2C380\" alt=\"Admin Notices While Logged in as A Subscriber\" /></a>Admin Notices While Logged in as A Subscriber\n<p>As you can see, the notices disappear when logged in as a subscriber. While I initially thought this was an issue in core, it appears to be more of a developer issue. JS Morisset, who <a href=\"http://wptavern.com/please-stop-abusing-wordpress-admin-notices#comment-165464\">commented on the original article</a> has a possible explanation:</p>\n<blockquote><p>The word &#8216;admin&#8217; (for notices) could be interpreted in two ways — either they’re admin / back-end notices, or they’re administrator notices.</p>\n<p>I’ve always understood that they are the former (notices displayed on the admin back-end), and can be seen by any / all back-end users, so I use &#8216;current_user_can()&#8217; in my own code to display different kinds of messages. Maybe this is more of a developer awareness issue than a core WP issue.</p></blockquote>\n<p>While I have not analyzed the code in the plugins I tested, the <a href=\"https://developer.wordpress.org/reference/functions/current_user_can/\">current_user_can()</a> capability check would explain why admins see notices while subscribers do not.</p>\n<h2>What I&#8217;d Like to See in a Centralized WordPress Notifications Center</h2>\n<p>Admin notices are a great way for developers to inform users of important information. But with all the notices bombarding site administrators these days, there&#8217;s a need for an organizational user interface to manage them all. When considering the types of notifications to allow and display, a notification center in WordPress can easily turn into a deep rabbit hole.</p>\n<p>What I&#8217;d like to see is a notification center that notifies me of core, plugin, and theme updates in addition to whatever notices those items generate. I also want it to tell me about errors on the site. These notifications should be in an easy-to-use interface that&#8217;s quick to access. Notifications should be dismissable or have a status where they can be marked as read.</p>\n<p>As seen above, there are plenty of people and projects working on solutions to this problem. What would be your ideal WordPress notifications center?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Apr 2016 02:11:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"WPTavern: Developers Urge White House to Consider “Open by Default” for New Open Source Software Policy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53787\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"http://wptavern.com/developers-urge-white-house-to-consider-open-by-default-for-new-open-source-software-policy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7190:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/white-house.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/white-house.jpg?resize=1024%2C520\" alt=\"photo credit: The White House Washington DC - (license)\" class=\"size-full wp-image-52474\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/71380981@N06/19902559769\">The White House Washington DC</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc-nd/2.0/\">(license)</a>\n<p>Last month the White House <a href=\"http://wptavern.com/white-house-seeks-feedback-on-github-for-government-wide-open-source-software-policy\" target=\"_blank\">called for developers to comment on its proposed draft</a> for a Government-wide Open Source Software policy. The new policy would require code paid for by the government to be made available for reuse across other federal agencies and a portion (20%) of the custom code would be released as open source.</p>\n<p>The period for public comment officially ended yesterday and now the <a href=\"https://www.whitehouse.gov/omb/\" target=\"_blank\">White House Office of Management and Budget (OMB)</a> will analyze the feedback on GitHub to refine the final policy.</p>\n<h3>CIO of the Department of Homeland Security Affirms Benefits of Open Source for Cybersecurity</h3>\n<p>Yesterday, Luke McCormack, the Chief Information Officer of the Department of Homeland Security, offered <a href=\"https://github.com/whitehouse/source-code-policy/issues/222\" target=\"_blank\">formal comments on GitHub</a>, affirming the benefits of open source, especially in regard to cybersecurity:</p>\n<blockquote><p>When managed appropriately, releasing code as OSS and engaging with the community can have extensive cybersecurity benefits. Security through obscurity is not true security: we cannot depend on vulnerabilities not being exploited just because they have not been discovered yet. There are many examples of widely-used pieces of software that benefit greatly from constant and vigorous community reviews and contributions to find bugs, and thus making them more secure. We look forward to government systems joining them.</p></blockquote>\n<p>McCormack&#8217;s clarification of the department&#8217;s official position combats the common misconception that open source code is inherently insecure. The comment also affirms the department&#8217;s support for working with the open source community.</p>\n<p>&#8220;Participation in the open source community will further strengthen our systems and help fulfill the mission of the Department,&#8221; McCormack said. &#8220;Likewise, we believe in the potential of this policy to incentivize innovation and enable a new generation of companies to do business with the Government.&#8221;</p>\n<h3>Developers Push for an &#8220;Open by Default&#8221; Policy</h3>\n<p>The proposed policy encourages federal agencies to work together to make reusable modules and to build active communities around the open source code they release. It is a better use of American tax dollars, but there is also a significant contingency of developers who believe the policy doesn&#8217;t go far enough with its arbitrary 20% requirement.</p>\n<p>In an issue titled &#8220;<a href=\"https://github.com/WhiteHouse/source-code-policy/issues/90\" target=\"_blank\">Software should be &#8220;Open by default&#8221; not 20%</a>,&#8221; the Presidential Innovation Fellows Foundation (PIFF) shared the following statement summarizing the general consensus of its 120 members:</p>\n<blockquote><p>The PIF Foundation membership strongly believes that it is in the best interest of increased government efficiency and taxpayer savings for the OMB to set a policy of &#8216;open by default&#8217; for custom software developed by the Federal Government rather than setting a goal of at least 20% OSS as originally proposed in the source code policy.</p></blockquote>\n<p><a href=\"http://ben.balter.com/\" target=\"_blank\">Ben Balter</a>, open source advocate and product manager at GitHub, <a href=\"https://github.com/WhiteHouse/source-code-policy/issues/90#issuecomment-207820011\" target=\"_blank\">expanded</a> on why the PIFF believes that taxpayer-funded government code should be open by default. Balter penned an <a href=\"https://fcw.com/articles/2016/04/11/balter-open-source-opinion.aspx\" target=\"_blank\">op-ed for FCW</a> about how the proposed open source policy, with its 20% requirement, is a missed opportunity to modernize government. He contends that the proposed three-year pilot program will not likely produce results beyond what is already known, as open source has already undergone a two-decade pilot. By 2019, the push for &#8216;open by default&#8217; will be long overdue:</p>\n<blockquote><p>It&#8217;s no secret that government agencies lag behind the private sector with regard to technology, and the proposed source code policy hesitantly testing the waters of open source is no exception. Open source software isn&#8217;t a potential fad to be cautiously evaluated as part of a three-year pilot program, nor are the benefits unknown or unproven in large enterprises. Open source is simply how industry builds software today. You&#8217;d be hard-pressed to find a startup worth its venture capital funding that isn&#8217;t based, at least in part, on open source software. The same holds true of most industry leaders, already embracing open source as a core part of their business strategy, including Microsoft, Apple, Google, IBM, SAP and Adobe to name a few.</p></blockquote>\n<p>Mozilla representatives also <a href=\"https://github.com/WhiteHouse/source-code-policy/issues/159\" target=\"_blank\">commented on the issue</a> to affirm its support for “open by default” and clear international licensing. The company identified four key reasons for shooting for 100% rather than mandating a minimum requirement:</p>\n<ul>\n<li>Open source by default is consistent with the principle that the public should receive maximal benefit from the expenditure of their tax dollars.</li>\n<li>Software produced in the open will be of high quality and will help promote the public’s trust due to the extra scrutiny it can receive and the potential contribution of external interested parties.</li>\n<li>The additional burden of opening source code to the public should not be great if the software already has to be prepared for sharing within the Federal government.</li>\n<li>The burden of tracking, assessing and reporting on percentages is removed, as is the problem of deciding how to make the measurements in the first place.</li>\n</ul>\n<p>Mozilla and many others commenting on the issue are urging the White House to reject the notion of an arbitrary 20% target and instead aim for open source from the outset, removing sensitive parts of the code base as necessary.</p>\n<p>It&#8217;s unclear how much weight this particular issue will hold in the creation of the final policy, but the opportunity for industry experts to comment on and contribute to the process is already a major step forward. The policy is still in draft status and we will publish an update once the OMB has finalized its decision.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 19 Apr 2016 22:35:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: Linus Torvalds Explains How Open Source Led to the Success of Linux\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53795\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/linus-torvalds-explains-how-open-source-led-to-the-success-of-linux\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4722:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/TED-linus-torvalds-interview.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/TED-linus-torvalds-interview.png?resize=1025%2C570\" alt=\"TED-linus-torvalds-interview\" class=\"aligncenter size-full wp-image-53797\" /></a></p>\n<p>In a rare and deeply personal <a href=\"http://www.ted.com/talks/linus_torvalds_the_mind_behind_linux\" target=\"_blank\">interview</a> with TED Curator Chris Anderson, Linus Torvalds spoke about how open source made his projects what they are today. Torvalds, creator of the Linux kernel and the Git version control system, revealed that he prefers to work alone, in his bathrobe, in total silence. Although he heads up one of the largest open source projects in the world, with 1,000 contributors involved in every bimonthly release, Torvalds claims he is not a people person.</p>\n<p>&#8220;I did not start Linux as a collaborative project,&#8221; Torvalds said. &#8220;I started it as one in a series of many projects I had done at the time for myself, partly because I needed the end result, but even more because I just enjoyed programming.&#8221;</p>\n<p>Torvalds said that open source wasn&#8217;t really on his radar at all. As Linux grew, it became something he wanted to show off to people and he made it publicly available. It wasn&#8217;t even open source at that point, which was mainly called &#8220;free software&#8221; back then. He had no intention of using open source to improve his project. He simply invited comments on his project and, to his amazement, people took interest in the code and started contributing ideas.</p>\n<p>&#8220;Every project before that had been completely personal, and it was a revelation when people just started commenting, started giving feedback on your code,&#8221; Torvalds said.</p>\n<p>As the Linux project grew, thousands of people wanted to contribute. Torvalds said that it reached a breaking point where he knew he couldn&#8217;t scale it to work with that many people without having some kind of version control system in place.</p>\n<p>&#8220;So git is my second project, which was only created for me to maintain my first project,&#8221; he said. &#8220;And this is literally how I work. I do code for fun, but I want to code for something meaningful. Every single project that I&#8217;ve ever done has been for something I needed.&#8221;</p>\n<p>Ironically, for someone who professes not to be a people person, Torvalds revolutionized collaborative development for teams and projects with Git. He said that he has often been in conflict with other people and can be &#8220;myopic when it comes to other people&#8217;s feelings.&#8221; Open source gave him a way to work effectively with other people:</p>\n<blockquote><p>One of the things I really like about open source is it allows different people to work together. We don&#8217;t have to like each other, and sometimes we really don&#8217;t like each other. There are very, very heated arguments. You don&#8217;t even agree to disagree &#8211; it&#8217;s just that you&#8217;re interested in different things. </p>\n<p>Coming back to the point that I said earlier, that I was afraid of commercial people taking advantage of your work &#8211; It very quickly turned out that those commercial people were lovely people. And they did all the things that I was not at all interested in doing and they had completely different goals. And they used open source in ways that I just did not want to go. But because it was open source they could do it and it actually works really beautifully together.</p></blockquote>\n<p>One of the most interesting things about his story is that he first embraced open source out of practicality, not because of ideological convictions.</p>\n<p>&#8220;Without doing the whole open-source-and-really-letting-go thing, Linux would never have been what it is,&#8221; Torvalds said. Even so, he said he doesn&#8217;t necessarily think the principle can be applied to other aspects of life beyond code without a lot of grey areas.</p>\n<p>Despite having changed the future by creating technology that powers the internet, Torvalds does not consider himself a visionary.</p>\n<p>&#8220;I am not a visionary,&#8221; he said. &#8220;I do not have a five year plan. I&#8217;m an engineer. I&#8217;m perfectly happy with all the people who are walking around staring at the clouds and looking at the stars and saying, &#8216;I want to go there.&#8217; But I&#8217;m looking at the ground and I want to fix the pothole that&#8217;s right in front of me before I fall in.&#8221;</p>\n<p>Check out the 21-minute interview in the video below:</p>\n<p></p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 19 Apr 2016 05:05:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"WPTavern: WordPress 4.6 Development Kicks Off This Week, Dominik Schilling to Lead Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53759\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"http://wptavern.com/wordpress-4-6-development-kicks-off-this-week-dominik-schilling-to-lead-release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4254:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/sharpened-pencil.jpg\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/sharpened-pencil.jpg?resize=960%2C511\" alt=\"photo credit: Angelina Litvin\" class=\"size-full wp-image-53775\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/JLXDNN5BNE\">Angelina Litvin</a>\n<p>As soon as WordPress 4.5 was out the door, WordPress 4.6 release lead Dominik Schilling opened up the floor for <a href=\"https://make.wordpress.org/core/2016/04/14/wordpress-4-6-whats-on-your-wish-list/\" target=\"_blank\">discussion on wish list items</a> ahead of the kickoff chat on Wednesday. The development community chimed in with feedback on their users’ biggest pain points, important UX issues to be solved, and existing features they would like to see polished.</p>\n<p>If the 200+ comments on the post are any indication, WordPress users and contributors are buzzing with ideas for improving the software in the upcoming release. The Make/WordPress core blog doesn&#8217;t have a voting system, but a few of the wish list items with the most +1&#8217;s include:</p>\n<ul>\n<li>Many-to-many relationships between posts and users (à la <a href=\"https://wordpress.org/plugins/posts-to-posts/\" target=\"_blank\">Posts 2 Posts</a>)</li>\n<li>Group ownership and content management</li>\n<li>Custom post statuses</li>\n<li>Multi-author support for single page/post/term items</li>\n<li>Fix long-standing <a href=\"https://core.trac.wordpress.org/ticket/4539\" target=\"_blank\">issues with wptexturize</a></li>\n<li><a href=\"https://core.trac.wordpress.org/query?status=!closed&keywords=~https\" target=\"_blank\">HTTPS improvements</a></li>\n<li>Add a new core <a href=\"https://core.trac.wordpress.org/ticket/32417\" target=\"_blank\">media widget</a></li>\n<li><a href=\"https://core.trac.wordpress.org/ticket/16379\" target=\"_blank\">Better UI for creating a &#8220;front&#8221; page</a></li>\n<li>Support for <a href=\"https://core.trac.wordpress.org/ticket/19627\" target=\"_blank\">allowing themes to register a static front page</a> to be automatically turned on at activation</li>\n<li>Remove the plugin/theme editor and make it into a plugin</li>\n<li>Fields API</li>\n<li><a href=\"https://core.trac.wordpress.org/ticket/12668\" target=\"_blank\">Custom Comment Types</a></li>\n<li><a href=\"https://core.trac.wordpress.org/ticket/21022\" target=\"_blank\">Use bcrypt for passwords</a></li>\n</ul>\n<p>Ella Van Dorpe also posted a <a href=\"https://make.wordpress.org/core/2016/04/12/editor-wish-list-4-6/\" target=\"_blank\">summary</a> of the most recent meeting for contributors on the core editor component. The team discussed a wish list for the editor in 4.6 and beyond, including the possibility of creating a feature plugin that uses <a href=\"https://nytimes.github.io/ice/demo/\" target=\"_blank\">ICE</a> to allow suggestions and comments on content. A <a href=\"https://core.trac.wordpress.org/ticket/36474\" target=\"_blank\">revamp of the Publish meta box</a>, more experimentation with inline toolbars, more formatting shortcodes, and other improvements are also on the list.</p>\n<p>Weston Ruter and contributors plan to continue chipping away at the <a href=\"https://make.wordpress.org/core/2015/09/23/outlining-a-possible-roadmap-for-the-customizer/\" target=\"_blank\">customizer roadmap</a> and component page with a focus on <a href=\"https://make.wordpress.org/core/2015/01/26/customizer-transactions-proposal/\" target=\"_blank\">customizer transactions</a>. Ruter would also like to introduce <a href=\"https://core.trac.wordpress.org/ticket/34923\" target=\"_blank\">basic content authorship</a> in the customizer in 4.6, along with improvements to existing features.</p>\n<p>The 4.6 <a href=\"https://make.wordpress.org/core/2016/04/14/wordpress-4-6-whats-on-your-wish-list/\" target=\"_blank\">wish list</a> offers a small preview of what might be coming in this release, and there&#8217;s still time to contribute new items and feedback. If you want to advocate for your ticket or wish list item, join the WordPress 4.6 kickoff chat in the #core Slack channel on Wednesday at <a href=\"http://www.timeanddate.com/worldclock/fixedtime.html?iso=20160420T2000\" target=\"_blank\">3:00PM CDT</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Apr 2016 18:25:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"WPTavern: Sucuri Partners with Let’s Encrypt to Offer Free SSL Certificates to All Customers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53721\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"http://wptavern.com/sucuri-partners-with-lets-encrypt-to-offer-free-ssl-certificates-to-all-customers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3363:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/ssl.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/ssl.png?resize=650%2C181\" alt=\"ssl\" class=\"aligncenter size-full wp-image-53744\" /></a></p>\n<p><a href=\"http://sucuri.net/\" target=\"_blank\">Sucuri</a>, a website security company that specializes in securing WordPress (and other CMS) sites, <a href=\"https://blog.sucuri.net/2016/04/sucuri-firewall-free-letsencrypt-ssl-certs-for-everyone.html\" target=\"_blank\">announced</a> that SSL certificates are now available at no cost to all customers who make use of the company&#8217;s <a href=\"https://sucuri.net/website-firewall/\" target=\"_blank\">firewall</a>. As a <a href=\"https://letsencrypt.org/sponsors/\" target=\"_blank\">sponsor of the Let&#8217;s Encrypt initiative</a>, Sucuri joins <a href=\"http://wptavern.com/automattic-partners-with-lets-encrypt-to-enable-https-on-all-wordpress-com-websites\" target=\"_blank\">Automattic</a> as one of the first companies to fully automate free SSL Certificates for all customers. The company has also enabled the new HTTP/2 protocol by default, which offers significant performance advantages compared to raw HTTPS.</p>\n<p>Unlike WordPress.com, which <a href=\"https://en.support.wordpress.com/https/\" target=\"_blank\">does not allow users to disable encryption</a>, Sucuri offers a &#8220;No HTTPS&#8221; option which will force all traffic to be redirected to HTTP. Customers can also select from partial SSL, full SSL, and Custom SSL (where they can use their own certificates).</p>\n<p>Despite their sponsorship of the Let&#8217;s Encrypt initiative, Sucuri&#8217;s founders emphasized that SSL support is not a magic wand that instantly makes your website secure, since it only protects information transferred between the browser and web server.</p>\n<p>&#8220;Even though we are providing SSL certificates to all our clients, we don’t subscribe to the idea that every website needs HTTPS enabled,&#8221; Sucuri CTO Daniel Cid said. &#8220;The idea that this makes for a more secure web is inaccurate.&#8221;</p>\n<p>Cid and co-founder Tony Perez share a perspective tempered by years of experience fixing hacked websites. The majority of compromises come through brute force attacks, software vulnerabilities, and DDOS attacks.</p>\n<p>In a post titled <a href=\"https://perezbox.com/2015/07/https-does-not-secure-your-website/\" target=\"_blank\">HTTPS Does Not Secure Your Website</a>, Sucuri CEO Tony Perez identified three general instances where SSL is essential: when transferring personal identifiable information, transaction data in e-commerce, and other sensitive data. Outside of these scenarios, HTTPS is not as critical.</p>\n<p>&#8220;I have no doubt that HTTPS will continue to grow in popularity,&#8221; Perez said. &#8220;What I take exception to is when technology professionals say that one of the driving factors for HTTPS is it’ll secure your website, because it won’t.&#8221;</p>\n<p>Sucuri only recommends HTTPS for customers who are already taking security seriously and want to add protection for data in transit. The company suggests putting more basic security measures in place first &#8211; keeping your software updated, implementing intrusion detection, getting code reviews, and storing passwords securely.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Apr 2016 04:21:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"Post Status: WordPress 4.5 — Draft Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=23435\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://poststatus.com/wordpress-4-5-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2142:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and Brian Krogsgard.</p>\n<p><span>WordPress 4.5 was just released, and comes backed with a lot of great new features. Some of our favorites have to do with the editing experience, but we go over all the new user facing features as well as under the hood bits of WordPress 4.5. We also dig into the earliest stages of WordPress 4.6, which is already underway.</span></p>\n<p><span>If you’ve been enjoying Post Status Draft, would you considering rating us in iTunes? We’ve never asked for it, but it would help tremendously! You can do so by going to iTunes, click “Ratings and Reviews” and leave a quick review. Thanks!</span></p>\n<a href=\"https://audio.simplecast.com/35565.mp3\">https://audio.simplecast.com/35565.mp3</a>\n<p><a href=