INSERT INTO `wp_posts` VALUES (1,1,'2015-12-10 14:38:33','2015-12-10 14:38:33','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2015-12-10 14:38:33','2015-12-10 14:38:33','',0,'http://127.0.0.1/wordpressTradeGlobal/?p=1',0,'post','',1),(10,1,'2015-12-11 06:29:48','2015-12-11 06:29:48','<code>\r\n<h2 id=\"Sourcing\"> Sourcing of Product</h2>\r\n<p> Chinese manufacturers can offer a great competitive advantage by offering low priced products. Unfortunately, it is not easy to find a reliable source of products directly from the manufacturer. H-J can help locating the best manufacturing company and monitor their activities to ensure product reliability. Your company will be guaranteed a constant flow of product and a reliable quality.</p>\r\n<h2 id=\"ImportExport\"> Import/Export across countries</h2>\r\n<p>H-J has the ability to import products from any country into China using our import license and resources. We have a dedicated team that can offer a full service job.\r\nIn addition to importing products into China, H-J also holds an export license capable of exporting any product from China to any country in the world.</p>\r\n<h2  id=\"warehousing\">Warehousing</h2>\r\n<p>Trade Bucket Global can offer warehousing in our Tianjin distribution plant. We are equipped with docking stations and security on site. Your product will be safe at H-J and we can provide reports on product levels at your convenience.</p>\r\n<h2 id=\"custom-packaging\">Customize Packaging</h2>\r\n<p>H-J can provide packaging, labeling, sorting, bar-coding, etc. according to your company needs. This value added service can offer flexibility in your supply chain.</p>\r\n<h2 id=\"freight-services\">Freight Services</h2>\r\n<p>The H-J group of companies has more than 30 years of extensive experience in freight logistics. We have contacts and resources to handle any freight needs your company may have. We can offer competitive pricing and provide options for your needs.</p>\r\n<h2 id=\"quality-control\">Quality Control</h2>\r\n<p>Our company can provide value added services such as the implementation of a quality control program to meet your specifications. You can guarantee the product will meet your quality standard before it leaves China. It will eliminate the chance to receive bad product in your country of destination.</p>\r\n</code>','Services','','publish','closed','closed','','services','','','2016-02-11 11:34:54','2016-02-11 06:04:54','',0,'http://127.0.0.1/wordpressTradeGlobal/?page_id=10',0,'page','',0),(11,1,'2015-12-11 06:29:48','2015-12-11 06:29:48','','Services','','inherit','closed','closed','','10-revision-v1','','','2015-12-11 06:29:48','2015-12-11 06:29:48','',10,'http://127.0.0.1/wordpressTradeGlobal/index.php/2015/12/11/10-revision-v1/',0,'revision','',0),(12,1,'2015-12-11 06:30:37','2015-12-11 06:30:37','<ul style=\"list-style-type: square;\">\r\n  <li>Coffee\r\n      coffee2\r\n      coffee3</li>\r\n  <li>Tea\r\n      Tea2\r\n      Tea3</li>\r\n  <li>Coca Cola\r\n      Coca cola2\r\n      Coca cola3</li>\r\n</ul>','How We Work !!','','publish','closed','closed','','how-we-work','','','2016-01-10 10:51:05','2016-01-10 05:21:05','',0,'http://127.0.0.1/wordpressTradeGlobal/?page_id=12',0,'page','',0),(13,1,'2015-12-11 06:30:37','2015-12-11 06:30:37','','How We Work !!','','inherit','closed','closed','','12-revision-v1','','','2015-12-11 06:30:37','2015-12-11 06:30:37','',12,'http://127.0.0.1/wordpressTradeGlobal/index.php/2015/12/11/12-revision-v1/',0,'revision','',0),(17,1,'2015-12-11 06:33:24','2015-12-11 06:33:24','<code>\r\n       <div class=\"col1\">\r\n           <div class=\"columContent\">\r\n               <h3>WHERE WE ARE </h3>\r\n                <p class=\"upper-case\"> Address</p>\r\n                <h3>TALK TO US</h3>\r\n                <p class=\"upper-case\">9820955392</p>\r\n                <h3>EMAIL US</h3>\r\n             