cupboards, faucets, pipes, cement and lot of other building materials.</p>\r\n<h3 id=\"FMCG\">FMCG/Cosmetics &amp; Food</h3>\r\n<p>\r\nWe have experience in sending/receiving consignments of perishable items like fruits, vegetables, frozen food, grain noodles, sauces, cooking and cosmetic oils, animal fodder ingredients, makeup items etc. We provide highest attention to legal requirements, storage quality and handling of fragile items.</p>','Supported Industries','','publish','closed','closed','','industries','','','2016-02-16 12:39:46','2016-02-16 07:09:46','',0,'http://ivyhomebeautyservices.com/wordpressTradeGlobal/?page_id=308',0,'page','',0),(309,1,'2016-02-16 12:11:59','2016-02-16 06:41:59','<code>\r\n</code>\r\n<h3 id=\"P&amp;C\">Pharmaceuticals And Chemicals</h3>\r\n<p>\r\nWe have experience in import and export of raw pharmaceutical ingredients for generic and patented medicines with due care to certification, specialized packaging and legal &amp; statutory framework across USA, europe, China, India Far East and Africa.</p>\r\n\r\n<p>We have knowledge and experience in sourcing and transportation of industrial chemicals for industries like Agro, Pesticides, Paints, Coatings, Resins, Specialty Chemicals, Organic &amp; Inorganic, Dyes, Pharma, Bulk Drugs &amp; API, Construction &amp; Water Treatment, Electronics, Plastic &amp; Polymers, Rubber &amp; Textile etc</p>\r\n<h3 id=\"G&amp;F\">Garment and Furnishing</h3>\r\n<p>\r\nWe support sourcing, marketing and transportation of yearns, raw cotton, types of denim, high quality cotton and silk, Jute, nylon, georgette clothing. We also support readymade garments like, children’s wear, leggings, Tee shirts, Denim and cotton Jeans, Formal and Casual jackets, caps, socks.\r\nWe have specialization and wide reliable contacts, special offers and variety of options available for type of curtains, covers, bed spreads, mattresses , comforters, quilts, pillow covers, bathroom linens , warm cloths, thermals. We Support all c